bsite, www.Apitap.com (including affiliated URL’s) and (iv) and other related features and services provided from time to time. In the Terms of Service, we refer to the above services collectively as the Apitap Services.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You will be able to view the Terms of Service and Privacy Policy at any time as follows: (1) on our website at www.Apitap.com/privacy and (2) on your mobile device by using the Help Option in the Apitap menu.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">2. Eligibility for the Apitap Platform.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">(a) Overview.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap App is a mobile application or \"App\" that may be preloaded on, or which you may download onto, a digital or mobile device. In the Terms of Service, we refer to a device that is eligible for use with the Apitap Services as an Apitap-Enabled Mobile Device.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We reserve the right to add and remove the types of devices that are Apitap-Enabled Mobile Devices at any time, with notice.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">(b) Eligibility Requirements.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">In order to activate and use the Apitap app, it is advised that your Wireless Account should be current and in good standing.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">In order to activate and use your Apitap app, you must establish an Apitap Account.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you are under the age of 18, you need the consent of your parent or guardian to activate and use the Apitap app. You represent and warrant that you have this consent (if you are under the age of 18) and that you otherwise have the capacity to enter into the Terms of Service.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">3. Apitap Services&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You are independently responsible for complying with all applicable laws in all of your actions related to your use of Apitap services, regardless of the purpose of the use. In addition, you must adhere to the terms of this Acceptable Use Policy.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">4. Prohibited Activities&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>(a) You may not use the Apitap Platform or services for activities that:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Violate any law, statute, ordinance or regulation as punishable by law under the legal jurisdictions of including, but not limited to, your home address, delivery address, the home and/or business address of the merchant you are dealing with, and/or Apitap’s business addresses.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to transactions involving narcotics, steroids, certain controlled substances or other products that present a risk to consumer safety and related illegal drug paraphernalia, as dictated by your local, state, and federal laws.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that encourage, promote, facilitate or instruct others to engage in illegal activity&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to stolen goods including digital and virtual goods&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that promote hate, violence, racial intolerance, or the financial exploitation of a crime&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that are considered obscene, as defined by local, state and federal laws where you reside.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that infringe or violate any copyright, trademark, right of publicity or privacy or any other proprietary right under the laws of any jurisdiction&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to certain sexually oriented materials or services, not covered in 4.a.i&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to ammunition, firearms, or certain firearm parts or accessories, or certain weapons or knives regulated under applicable law.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to transactions that show the personal information of third parties in violation of applicable law&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Support pyramid or Ponzi schemes, matrix programs, other \"get rich quick\" schemes or certain multi-level marketing programs.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">5. The Apitap Platform&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap has developed a social commerce platform (referred to as the Apitap Platform that utilizes mobile technology, that includes but is not limited to contactless and/or near-field communications (NFC) to enable you to use your Mobile Device or a web site to complete purchase transactions using prepaid, credit, debit or other payment products (we refer to these products as Payment Cards). The Apitap Platform also allows you to receive commerce benefits from participating retailers, food establishments, and other merchants. The Apitap Platform is part of the system-enabled Participating Merchants.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap Platform also enables you to use various offers and loyalty promotions that are made available to you by Participating Merchants. We refer to these offers, coupons and loyalty cards as Loyalty Programs. We refer to any agreement between you and a Participating Merchant, such as a loyalty card agreement, as a Commerce Activity Contract&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Certain features of the Apitap app may not work in certain circumstances, such as when your Mobile Device is placed in \"Airplane\" mode or when you are travelling internationally.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Terms of Service apply only to your use of the Apitap Platform. The terms of the Payment Cards, third party Payment Accounts and Payment Card Servicing Tools are subject to separate agreements (generally referred to as Cardholder Agreements) that you have entered into and/or will enter into with Participating Issuers and are governed entirely by such agreements. You agree that we are not a party to these agreements, nor are we responsible for the content, accuracy or unavailability of any Payment Cards, Commerce Activities, transactions or purchases while using Isis Services.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Your use of the Mobile Device and any of the wireless services may also be subject to separate agreements you may enter into with the Wireless Service Providers and other third parties and is governed entirely by those agreements. You agree that we are not a party to any of those agreements and have no responsibility for any of the services provided by those third parties.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You also understand that your use of the Apitap Platform may require certain technology, systems and services provided by third parties other than Participating Issuers and Participating Merchants, such as, for example, payment processors, payment networks, Wi-Fi providers, NFC readers and related technologies, Wireless Service Providers and other telecommunications carriers.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may need share certain information with these third parties in order to provide Apitap Services. You explicitly permit such sharing with those third parties in order to deliver the Apitap Services to you as set forth in the Privacy Policy.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">6. Apitap User Roles and Permissions/Managing Accounts.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"fo