lign: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">To help ensure your safety when using the Apitap app please keep in mind the following:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Do not use the Apitap app while driving or operating machinery as such use may result in injury to both you and others;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Make sure you safeguard your Apitap Password and/or PIN to avoid unauthorized use.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">10. Usage Fees and Charges&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Consumer is responsible for all charges applicable to its account, including but not limited to all usage-based charges, irrespective of whether such arise as a result of fraud, non-payment on the part of any of Consumers Affiliates or other permitted users, pursuant to this Agreement, or for any other reason except as expressly provided herein&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap does not charge consumers additional fees related to the general use of the Apitap platform. However, in the future Apitap may offer services or special benefits for consumers that may require an additional charge or recurring fee, at that time, in order for consumers to use or participate with them. We reserve the right to provide these paid services or benefits in the future, and will notify the consumer as they become available&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Possible Wireless Service Provider Fees and Charges; Data Limit Applicability. Your Wireless Service Provider may charge you for text messages and/or data transmitted to or from your Mobile Device. Text messaging and data transmissions also may be applied against data usage limits set by your Wireless Service Provider and you are solely responsible for such charges. Those messages and transmissions and related charges may be triggered by your usage of the Apitap app (changes to your security credentials, for example) as well as updates to the Apitap app may appear on your Wireless Service Provider bill pursuant to your Wireless Service Contract. Additionally, roaming and other fees and charges may apply when roaming outside your home service area, including when using your Apitap app internationally. You should contact your Wireless Service Provider for complete pricing and other details.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Other Possible Third-Party Fees and Charges. Participating Issuers and Participating Merchants also may assess fees and charges such as annual fees in connection with their Payment Cards and Commerce Activities; you should contact your Participating Issuers or Participating Merchants for complete pricing and other details.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">11. Your Apitap Account and Security&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">User ID, Password and/or PIN and Security Q&amp;A will establish your Apitap Account as part of the process of activating the Apitap Platform with us. The process includes establishing a User ID (i.e., your valid email address), a Password, and may include setting up an app PIN or Security Questions and Answers for certain accounts or usage. You agree that any information you provide to us, as part of the activation process or otherwise, will be accurate and that you shall keep it current with us. You are responsible for safeguarding your User ID, Password, PIN and Security Answers as provided. You are also responsible for any and all activity that occurs under or in association with your Apitap Account, including such activity that results from your failing to keep your User ID, Password, PIN and Security Answers secure and confidential. Should you attempt to login with an invalid PIN more than 3 times, the Apitap app may become locked, requiring you to reset your PIN using your User ID, Password and Security Answers.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Reporting Unauthorized Use and Loss or Theft. You agree to notify Apitap immediately in the event of any (i) unauthorized use of your Apitap Services, User ID, Password or PIN or (ii) loss or theft of your Mobile Device. You will also need to contact each of your Participating Issuers in order to prevent unauthorized access to your Payment Cards, or to restore access to your payment accounts on another Apitap-Enabled Mobile Device.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">12. Communicating with you Electronically&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may communicate information, notices, messages, service alerts, announcements, agreements, disclosures or other communications (\"Electronic Communications\") associated with the Apitap Platform to you electronically through the Apitap app, by e-mailing such Electronic Communications to the e-mail address on file in your Apitap Account, or sending you such Electronic Communications via text message to your M