-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Except as otherwise provided herein, all disputes and claims relating to or arising out of the Terms of Service for your use of the Apitap Platform and any other claims or causes of action relating to the performance or advertising of the Apitap Services or the Terms of Service, shall be settled by binding arbitration in the county of Los Angles, California. All disputes as to arbitrability or the interpretation or enforceability of this arbitration clause shall be for the court to resolve in accordance with the Federal Arbitration Act. In addition, instead of arbitration, either party may file an individual action in small claims court.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The arbitration shall be administered by the American Arbitration Association (\"AAA\") in accordance with its Commercial Arbitration Rules and Supplementary Procedures for Consumer-Related Disputes&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You and we agree that each may bring claims against the other only in an individual capacity. Such claims may seek relief only for the claimant and not any other customer. Neither you nor we may bring claims as a plaintiff or class member in any purported class, representative or private attorney general proceeding. Unless you and we agree otherwise, the arbitrator may not consolidate more than one person\'s claims and may not award declaratory or injunctive relief that would affect other customers or that is not essential to provide relief for your or our individual claim