font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>(a) You may not use the Apitap Platform or services for activities that:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Violate any law, statute, ordinance or regulation as punishable by law under the legal jurisdictions of including, but not limited to, your home address, delivery address, the home and/or business address of the merchant you are dealing with, and/or Apitap’s business addresses.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to transactions involving narcotics, steroids, certain controlled substances or other products that present a risk to consumer safety and related illegal drug paraphernalia, as dictated by your local, state, and federal laws.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that encourage, promote, facilitate or instruct others to engage in illegal activity&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to stolen goods including digital and virtual goods&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that promote hate, violence, racial intolerance, or the financial exploitation of a crime&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that are considered obscene, as defined by local, state and federal laws where you reside.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that infringe or violate any copyright, trademark, right of publicity or privacy or any other proprietary right under the laws of any jurisdiction&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to certain sexually oriented materials or services, not covered in 4.a.i&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to ammunition, firearms, or certain firearm parts or accessories, or certain weapons or knives regulated under applicable law.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to transactions that show the personal information of third parties in violation of applicable law&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Support pyramid or Ponzi schemes, matrix programs, other \"get rich quick\" schemes or certain multi-level marketing programs.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">5. The Apitap Platform&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap has developed a social commerce platform (referred to as the Apitap Platform that utilizes mobile technology, that includes but is not limited to contactless and/or near-field communications (NFC) to enable you to use your Mobile Device or a web site to complete purchase transactions using prepaid, credit, debit or other payment products (we refer to these products as Payment Cards). The Apitap Platform also allows you to receive commerce benefits from participating retailers, food establishments, and other merchants. The Apitap Platform is part of the system-enabled Participating Merchants.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap Platform also enables you to use various offers and loyalty promotions that are made available to you by Participating Merchants. We refer to these offers, coupons and loyalty cards as Loyalty Programs. We refer to any agreement between you and a Participating Merchant, such as a loyalty card agreement, as a Commerce Activity Contract&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Certain features of the Apitap app may not work in certain circumstances, such as when your Mobile Device is placed in \"Airplane\" mode or when you are travelling internationally.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Terms of Service apply only to your use of the Apitap Platform. The terms of the Payment Cards, third party Payment Accounts and Payment Card Servicing Tools are subject to separate agreements (generally referred to as Cardholder Agreements) that you have entered into and/or will enter into with Participating Issuers and are governed entirely by such agreements. You agree that we are not a party to these agreements, nor are we responsible for the content, accuracy or unavailability of any Payment Cards, Commerce Activities, transactions or purchases while using Isis Services.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Your use of the Mobile Device and any of the wireless services may also be subject to separate agreements you may enter into with the Wireless Service Providers and other third parties and is governed entirely by those agreements. You agree that we are not a party to any of those agreements and have no responsibility for any of the services provided by those third parties.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You also understand that your use of the Apitap Platform may require certain technology, systems and services provided by third parties other than Participating Issuers and Participating Merchants, such as, for example, payment processors, payment networks, Wi-Fi providers, NFC readers and related technologies, Wireless Service Providers and other telecommunications carriers.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may need share certain information with these third parties in order to provide Apitap Services. You explicitly permit such sharing with those third parties in order to deliver the Apitap Services to you as set forth in the Privacy Policy.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">6. Apitap User Roles and Permissions/Managing Accounts.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You can access and manage your Apitap Account at any device from which you are able to access the Internet and may access Apitap via a common web browser.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">7. Apitap does not do the following:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Set the terms of any purchase, payment, expiration date, or other transaction between you and any Participating Merchant or Participating Issuer; nor do the Terms of Service in any way modify any separate agreement you may have with any third party, including a Commerce Activity Contract, Wireless Service Contract or Cardholder Agreement;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Process payments, or in any way act as or provide the services of a bank or other financial institution or Participating Issuer;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Insure, endorse or assume any liability for any products or services you purchase or use by means of the Apitap app; or,&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Control or have any liability for payments, returns, refunds, charge-backs, Commerce Activities or any questions or disputes you may have with any Participating Merchant or Participating Issuer related to any purchase, or with a Wireless Service Provider related to your use of the Apitap app, Platform or otherwise.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">8. Updates.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may from time to time provide updates to the Apitap Platform. These updates may be provided automatically \"over the air\" and are designed to improve, enhance and further develop the Apitap Platform. These updates may take the form of revisions to the Terms of Service or Privacy Policy, and can include Electronic Communications, bug fixes, enhanced functions and new software modules. You agree to receive and install such updates (and permit us to deliver these to you) as part of your use of the Apitap Platform.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">9. Apitap Precautions.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">To help ensure your safety when using the Apitap app please keep in mind the following:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Do not use the Apitap app while driving or operating machinery as such use may result in injury to both you and others;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Make sure you safeguard your Apitap Password and/or PIN to avoid unauthorized use.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">10. Usage Fees and Charges&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Consumer is responsible for all charges applicable to its account, including but not limited to all usage-based charges, irrespective of whether such arise as a result of fraud, non-payment on the part of any of Consumers Affiliates or other permitted users, pursuant to this Agreement, or for any other reason except as expressly provided herein&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap does not charge consumers additional fees related to the general use of the Apitap platform. However, in the future Apitap may offer services or special benefits for consumers that may require an additional charge or recurring fee, at that time, in order for consumers to use or participate with them. We reserve the right to provide these paid services or benefits in the future, and will notify the consumer as they become available&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Possible Wireless Service Provider Fees and Charges; Data Limit Applicability. Your Wireless Service Provider may charge you for text messages and/or data transmitted to or from your Mobile Device. Text messaging and data transmissions also may be applied against data usage limits set by your Wireless Service Provider and you are solely responsible for such charges. Those messages and transmissions and related charges may be triggered by your usage of the Apitap app (changes to your security credentials, for example) as well as updates to the Apitap app may appear on your Wireless Service Provider bill pursuant to your Wireless Service Contract. Additionally, roaming and other fees and charges may apply when roaming outside your home service area, including when using your Apitap app internationally. You should contact your Wireless Service Provider for complete pricing and other details.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Other Possible Third-Party Fees and Charges. Participating Issuers and Participating Merchants also may assess fees and charges such as annual fees in connection with their Payment Cards and Commerce Activities; you should contact your Participating Issuers or Participating Merchants for complete pricing and other details.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">11. Your Apitap Account and Security&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">User ID, Password and/or PIN and Security Q&amp;A will establish your Apitap Account as part of the process of activating the Apitap Platform with us. The process includes establishing a User ID (i.e., your valid email address), a Password, and may include setting up an app PIN or Security Questions and Answers for certain accounts or usage. You agree that any information you provide to us, as part of the activation process or otherwise, will be accurate and that you shall keep it current with us. You are responsible for safeguarding your User ID, Password, PIN and Security Answers as provided. You are also responsible for any and all activity that occurs under or in association with your Apitap Account, including such activity that results from your failing to keep your User ID, Password, PIN and Security Answers secure and confidential. Should you attempt to login with an invalid PIN more than 3 times, the Apitap app may become locked, requiring you to reset your PIN using your User ID, Password and Security Answers.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Reporting Unauthorized Use and Loss or Theft. You agree to notify Apitap immediately in the event of any (i) unauthorized use of your Apitap Services, User ID, Password or PIN or (ii) loss or theft of your Mobile Device. You will also need to contact each of your Participating Issuers in order to prevent unauthorized access to your Payment Cards, or to restore access to your payment accounts on another Apitap-Enabled Mobile Device.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">12. Communicating with you Electronically&nbsp;</span></font></div><div style=\"font-weight: normal; font