Apitap Services with or without notice. You agree that we shall not be liable to you or to any third party for any modification, suspension, or discontinuance of the Apitap Services.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">19. Miscellaneous Provisions&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Terms and Conditions of this Consumer Service Agreement contains the entire agreement between you and Apitap pertaining to your use of the Apitap Platform, and expressly exclude any writings, representations, agreements or understandings not specifically captured or contained herein, whether written or oral. The Terms of Service are governed by the U.S. Federal Arbitration Act, applicable U.S. federal law, and the laws of the U.S. state or territory in which you are domiciled, without regard to the conflicts of laws rules of that state or territory. If any part of the Terms of Service is held to be invalid under the law of a particular U.S. state or territory, that provision will not apply in that U.S. state or territory, and its invalidity will not affect the validity of the balance of the Terms of Service, which shall remain valid and enforceable according to their terms. The failure to enforce any of the Terms of Service on one occasion shall not prevent enforcement on any other occasion or the enforcement of any other term. Headings and captions shall not be considered included for purposes of interpretation or application hereof, but are for convenience only. You may not assign the Terms of Service without our prior written consent.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">20. Privacy and Your Personal Information&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Please read our privacy policy at www.Apitap.com/privacy. Our Privacy Policy explains how we use and safeguard your data when you use the Apitap Services. You agree to our use of your data in accordance with our Privacy Policy.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal;\"><br/></div></div>','<h1 class=\"label\" style=\"text-align: center;\"><font face=\"Arial, Verdana\" style=\"\" size=\"4\">RETURNED - MERCHANDISE AND REFUND POLICY</font></h1><h1 class=\"label\" style=\"text-align: left;\"><font face=\"Arial, Verdana\" size=\"3\" style=\"font-weight: normal;\">Please note: The following return and refund policies may have additional terms, details, or conditions which may apply. Please review the individual Merchant’s Terms and Conditions under their Store Info section for additional details and conditions concerning payment and refund policies, as applicable.</font></h1><h1 class=\"label\" style=\"text-align: left;\"><span style=\"font-weight: normal; font-family: Arial, Verdana;\"><font size=\"3\">Any and all merchandise returned to an Apitap merchant must be; in it\'s original packaging, cannot be damaged, must have all originally included accessories, and everything must be in like new condition and working order.</font></span></h1>','<div style=\"text-align: center;\"><div style=\"text-align: center;\"><font face=\"Arial, Verdana\" size=\"4\"><b style=\"\">Please take a moment to review our Privacy Policy.</b></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><strong><br/></strong></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">This Privacy Policy describes the way Apitap uses and protects the information we collect about Customers and Users. This Privacy Policy does not cover information that you provide to third parties directly. We encourage you to review the privacy policies of any third party to whom you provide information to understand what information will be collected, and how it will be used or disclosed to others.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">This Privacy Policy applies to the Apitap Platform. When we refer to Apitap Platform in this Privacy Policy we mean: (i) the Apitap application (app) installed on your mobile device; (ii) your Apitap User account; (iii) the Apitap web management tools available to you at our website, www.apitap.com and (iv) other related features and services provided by Apitap or its affiliates.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">As used in this Privacy Policy:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">User is an individual or business who activates the Apitap Platform and a User is also anyone who visits the Website.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Personal Information is information that directly identifies or reasonably can be used to identify an individual User. Personal Information does not include Anonymous or Aggregated Information.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Anonymous Information means information that does not directly identify and cannot reasonably be used to identify an individual User.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Aggregated Information means information about groups or categories of Users that does not directly identify and cannot reasonably be used to identify an individual User. Aggregated Information is a kind of Anonymous Information.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Locations Services are electronic services used by mobile and web-based devices or applications that are used to determine a user’s current locations. This may take the form of activating and reading a mobile device’s GPS (Global Positioning System) data or by retrieving the information as provided by an (ISP) internet service provider.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Payment Cards are credit, debit and prepaid cards and other types of payment products.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Participating Issuer is a financial institution that issues Payment Cards and is participating in the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Participating Merchant is a merchant that is enabled to participate in the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You will be able to view our Privacy Policy at any time through the “About Apitap” sections of our mobile app and website. In addition, if you establish an Apitap Account, we will also send a link to the Privacy Policy to the email address you provided us when you established your Apitap Account.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"> </span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap Platform</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap has developed a mobile payment, promotional, and commerce platform that utilizes smartphone, contactless, Bluetooth, and near-field communication (NFC) technology, among others, to enable you to use the Apitap Platform to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Complete purchase transactions using prepaid, credit, debit or other payment products; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Receive certain offers, coupons and loyalty cards from participating retailers, food establishments, manufacturers, brands and other marketers</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Become involved in social networks developed around shopping and entertainment</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Experience traditional “in person” retail benefits including, but not limited to, in-store promotions and specials, advertising, sales assistance and on-site ordering.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Personal Information Collected When You Use the Apitap Platform</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We collect Personal Information in a variety of ways, including:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>• You provide it to us when you:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• activate your Apitap account,</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• use the Apitap Platform, or</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• interact with Customer care;</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• We collect data when you visit our websites and use our mobile application to provide you with a better and more customized user experience.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• We also obtain data from other sources (third parties), in connection with the operation of the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>We collect the following types of information, including Personal Information:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you establish an Apitap Account, we collect the information you provide; including but not limited to your name, email address, Apitap password and contact phone number.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Once you have established your Apitap Account, we collect information we may receive from your mobile device, if used with Apitap, such as your device type and your mobile device ID number. These are used to identify you on our system properly.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to load a Payment Card offered by a Participating Issuer, we collect the type and brand of Payment Card used (for example, type may include credit, debit or prepaid, and brand may include MasterCard, Visa, American Express, Discover), the Payment Card issuer (for example, the Participating Issuer issuing the Payment Card), and Payment Card account numbers, billing address, and expiration dates.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When a Payment Card is used, we collect the fact that a particular Payment Card was used, the location it was used at, the time and date of the transaction, and the identity of the Participating Merchant where the Payment Card was used.<span style=\"white-space:pre\">	</span></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">For other prepaid cards, in addition to the above information, we may also collect the card balance; and other data shared by the issuer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may receive information about the status of your Payment Card (for example, whether it is suspended or cancelled) from your Payment Card issuer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to \"Follow\" a Participating Merchant, we collect which merchant you \"Follow\" in order to provide you with offers and notifications from that Participating Merchant.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you choose to add a Participating Merchant loyalty card, we collect information such as the Participating Merchant and the loyalty card number; by adding a loyalty card to your Apitap Wallet you are choosing to \"Follow\" that Participating Merchant.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to provide your zip code or allow the use of location services, we collect that information in order to better provide you with local or targeted offers for your geographic area.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We also keep track of information about which offers you\'ve selected and used (for example, if you use an offer, we note the fact that the offer was presented by you to the Participating Merchant); and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you use a Payment Card or a loyalty card in connection with an offer that you present, we will collect the fact that a particular Payment Card or loyalty card was used in connection with that particular offer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you call Customer Care or login to the Website for customer care, we may collect information, including Personal Information, as follows:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you may provide to us for the administration, maintenance and use of your Apitap Account and the Apitap Platform. This information may include a new email address, new password, Security Questions and Answers or any other information you provide.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">At no time will a Apitap representative ever ask you for your account password or mobile access pin code.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information on whether your Apitap account was suspended or terminated; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information about your interaction with the Apitap Platform that may help us protect you from fraud and other misconduct or address the issue you contacted us about.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you visit our Website, we may collect information, including Personal Information, as follows:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you provide, such as your name, mailing address, email address, phone number(s) and unique identifiers (such as your user login and password);</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you provide if you apply for a job, such as your resume and other employment-related information; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information about your use of our Website</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Commonly available browser-based information including, but not limited to, type of browser and basic system data and device location (using location services) as provided by the browser.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may use what are referred to as “cookies”, which are browser-oriented pieces of code, to allow us to recognize users in order to provide faster and better service and features during subsequent visits.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may collect this information either when you provide it directly or through the use of:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Cookies or similar technologies to identify the computer or device, and to improve the quality of Apitap Services.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Web-beacons (small graphic images on a Web page or an HTML e-mail that are generally invisible); and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Software to collect data about your interactions with the Website, such as the time of your visit and whether you have visited the Website before.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You can manage cookies by using features and functions available on most Internet browsers. For example, most browsers will allow you to choose what cookies can be placed on your computer and to delete or disable cookies. You can find instructions for managing cookie controls on websites for particular browsers. Please note that disabling cookies may prevent you from using specific features on our Website.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If we combine or link cookie or web beacon information with Personal Information, we will treat the combined or linked information as Personal Information under this Privacy Policy.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may advertise our products and services on third party websites. The use of cookies, Web-beacons or similar technologies by such third parties is subject to their privacy policies - not this&nbsp; Privacy Policy.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Use of Your Personal Information</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We use the information we collect, including Personal Information, in a variety of ways. For example, we may use some or all of the information, including Personal Information, we collect to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Provide Apitap Services, including account specific customized functionality</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Notify you about Apitap Service announcements, software updates, changes to the Terms of Service or the Privacy Policy, service alerts or other communication messages in connection with your Apitap Platform user account and usage.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Develop, maintain and improve Apitap Services, and to perform data analysis and research for those purposes.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Investigate, prevent, or take action regarding violations of the Terms of Service or the terms and conditions on our Website or other acceptable use policies provided to you from time to time.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Help ensure security and quality control, and for troubleshooting purposes.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Comply with legal or regulatory requirements.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Respond to regulatory authorities and auditors.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Respond to a subpoena, court order or to establish our legal rights and defend against legal claims or other legal obligations.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Protect against or prevent fraud/identity theft or other illegal activities.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Manage risk and operability issues</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Otherwise operate our business as permitted by law.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may also use Aggregated Information and Anonymous Information for various purposes such as to perform data analysis and research for the purpose of developing, maintaining and improving Apitap Services; to evaluate the helpfulness of Apitap messaging; to assess the effectiveness of offers provided by Apitap on behalf of Participating Merchants and other third parties; and to market and advertise Apitap products and services.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you submit a job application or resume or send a request via the Website, we use Personal Information to communicate with you and, subject to applicable law, to make current hiring decisions, to make future hiring decisions (applicant information is retained for purposes of future job openings unless an applicant indicates otherwise) and to comply with legal obligations, including regarding hiring and workforce diversity.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Sharing of Personal Information with Third Parties</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We share information we collect, including Personal Information, with third parties who assist us in providing services and performing the activities described under the \"Use of your Personal Information\" heading above. Whenever we share with third parties who perform services for us or on our behalf, we require them to agree to maintain appropriate safeguards designed to protect the security and the confidentiality of the Personal Information that we provide to them. We also limit their use of the Personal Information to performing the services requested and limit the circumstances in which they may share the Personal Information with others.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We also may share your information, including Personal Information, with certain third parties (such as government agencies) as necessary to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Comply with legal or re