t-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><br/></div>',0,NULL,4701,NULL,'en',NULL,1,0,'<div style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><strong>Service Agreement Effective. 01/25/2021 </strong></span></div><div style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><br/></span></div><div style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><br/></span></div><div>Welcome to the ApiTap (\"ApiTap\", “APITAP”, \"We\", \"Our\") Social Commerce Platform comprising web sites, web widgets, mobile applications, and any other mobile or web services or applications owned, controlled, or offered by ApiTap (collectively, the \"ApiTap Platform\"). Subscribers, customers, users, and others who download, access, use, purchase and/or subscribe to the ApiTap Services (collectively or individually \"You\", “Your”, or \"Users\") must do so under the following terms and conditions of use.  </div><div><br/></div><div>BEFORE USING ANY OF THE APITAP PLATFORM or SERVICES, PLEASE READ CAREFULLY THE FOLLOWING TERMS AND CONDITIONS OF SERVICE. By accessing, browsing and/or using the ApiTap Platform, you acknowledge that you have read, understand and agree to be bound by all of the following terms and conditions, including any future modifications to this Terms of Service Agreement, all the consents and disclosures set forth in the ApiTap registration process (which are incorporated herein by this reference), and all guidelines (collectively, the “Agreement”). If you do not agree to this Agreement, then you are required to cease using the ApiTap Platform immediately. If you use the ApiTap Platform, you indicate that you expressly agree to the full terms of this Agreement. </div><div><br/></div><div><u>THIS AGREEMENT CONSTITUTES A BINDING CONTRACT BETWEEN YOU AND APITAP</u>.</div><div><br/></div><div><font color=\"#666666\">SOME OF THE APITAP PLATFORM IS AVAILABLE ONLY FOR PERSONS 18 YEARS OR OLDER. IF YOU ARE UNDER THE AGE OF 18, THEN YOU MUST REVIEW THESE TERMS AND CONDITIONS WITH YOUR PARENT OR GUARDIAN TO MAKE SURE THAT BOTH YOU AND YOUR PARENT OR GUARDIAN UNDERSTAND AND AGREE TO THIS AGREEMENT. YOU AGREE TO HAVE YOUR PARENT OR GUARDIAN REVIEW AND ACCEPT THIS AGREEMENT ON YOUR BEHALF THROUGH THE APITAP REGISTRATION PROCESS. IF YOU ARE A PARENT OR GUARDIAN ENTERING INTO THIS AGREEMENT FOR THE BENEFIT OF A CHILD UNDER 18, THEN YOU AGREE TO AND ACCEPT FULL RESPONSIBILITY FOR THAT CHILD\'S USE OF THE APITAP SERVICE, INCLUDING ALL FINANCIAL CHARGES AND LEGAL LIABILITY THAT HE, SHE, or THEY, MAY INCUR.</font></div><div><br/></div><div><strong>1. Applicability of Terms of Service </strong></div><div><br/></div><div>These terms and conditions (Terms of Service) are entered into by ApiTap and you. The Terms of Service apply to: (i) your ApiTap App; (ii) your ApiTap customer account; (iii) the ApiTap web management tools available to you at our website, www.ApiTap.com (including affiliated URL’s) and (iv) and other related features and services provided from time to time. In the Terms of Service, we refer to the above services collectively as the ApiTap Services.  </div><div><br/></div><div>You will be able to view the Terms of Service and Privacy Policy at any time as follows: (1) on our website at www.ApiTap.com/privacy and (2) on your mobile device by using the Help Option in the ApiTap menu. </div><div><br/></div><div><strong>2. Eligibility for the ApiTap Platform. </strong></div><div><br/></div><div><strong>(a) Overview. </strong></div><div><br/></div><div>The ApiTap App is a mobile application or \"App\" that may be preloaded on, or which you may download onto, a digital or mobile device. In the Terms of Service, we refer to a device that is eligible for use with the ApiTap Services as an ApiTap-Enabled Mobile Device. </div><div><br/></div><div>We reserve the right to add and remove the types of devices that are ApiTap-Enabled Mobile Devices at any time, with notice. </div><div><br/></div><div><strong>(b) Eligibility Requirements.</strong> </div><div><br/></div><div><ul><li>In order to activate and use the ApiTap app, it is advised that your Wireless Account should be current and in good standing. </li></ul></div><div><ul><li>In order to activate and use your ApiTap app, you must establish an ApiTap Account. </li></ul></div><div><ul><li>If you are under the age of 18, you need the consent of your parent or guardian to activate and use the ApiTap app. You represent and warrant that you have this consent (if you are under the age of 18) and that you otherwise have the capacity to enter into the Terms of Service. </li></ul></div><div><br/></div><div><strong>3. ApiTap Services </strong></div><div><br/></div><div>You are independently responsible for complying with all applicable laws in all of your actions related to your use of ApiTap services, regardless of the purpose of the use. In addition, you must adhere to the terms of this Acceptable Use Policy.  </div><div><br/></div><div><strong>4. Prohibited Activities </strong></div><div><strong><br/></strong></div><div><span style=\"font-size: 10pt;\"><span style=\"white-space: pre;\">	</span><strong>(a) </strong>You may not use the ApiTap Platform or services for activities that: </span></div><div></div><div><ul><li><span style=\"font-size: 10pt;\">Violate any law, statute, ordinance or regulation as punishable by law under the legal jurisdictions of including, but not limited to, your home address, delivery address, the home and/or business address of the merchant you are dealing with, and/or ApiTap’s business addresses. </span></li></ul></div><div><ul><li>Relate to transactions involving narcotics, steroids, certain controlled substances or other products that present a risk to consumer safety and related illegal drug paraphernalia, as dictated by your local, state, and federal laws. </li></ul></div><div><ul><li>Relate to items that encourage, promote, facilitate or instruct others to engage in illegal activity </li></ul></div><div><ul><li>Relate to stolen goods including digital and virtual goods </li></ul></div><div><ul><li>Relate to items that promote hate, violence, racial intolerance, or the financial exploitation of a crime </li></ul></div><div><ul><li>Relate to items that are considered obscene, as defined by local, state and federal laws where you reside.</li></ul></div><div><ul><li>Relate to items that infringe or violate any copyright, trademark, right of publicity or privacy or any other proprietary right under the laws of any jurisdiction </li></ul></div><div><ul><li>Relate to certain sexually oriented materials or services, not covered in 4.a.i </li></ul></div><div><ul><li>Relate to ammunition, firearms, or certain firearm parts or accessories, or certain weapons or knives regulated under applicable law.</li></ul></div><div><ul><li>Relate to transactions that show the personal information of third parties in violation of applicable law </li></ul></div><div><ul><li>Support pyramid or Ponzi schemes, matrix programs, other \"get rich quick\" schemes or certain multi-level marketing programs. </li></ul></div><div><br/></div><div><strong>5. The ApiTap Platform </strong></div><div><br/></div><div><ul><li>ApiTap has developed a social commerce platform (referred to as the ApiTap Platform that utilizes mobile technology, that includes but is not limited to contactless and/or near-field communications (NFC) to enable you to use your Mobile Device or a web site to complete purchase transactions using prepaid, credit, debit or other payment products (we refer to these products as Payment Cards). <span style=\"font-size: 10pt;\">The ApiTap Platform also allows you to receive commerce benefits from participating retailers, food establishments, and other merchants. </span><span style=\"font-size: 10pt;\">The ApiTap Platform is part of the system-enabled Participating Merchants. </span></li></ul></div><div><ul><li><span style=\"font-size: 10pt;\">The ApiTap Plat