cordance with the Federal Arbitration Act. In addition, instead of arbitration, either party may file an individual action in small claims court. </span></li></ul></div><div><ul><li><span style=\"font-size: 10pt;\">The arbitration shall be administered by the American Arbitration Association (\"AAA\") in accordance with its Commercial Arbitration Rules and Supplementary Procedures for Consumer-Related Disputes </span></li></ul></div><div><ul><li><span style=\"font-size: 10pt;\"><strong>You and we agree that each may bring claims against the other only in an individual capacity. Such claims may seek relief only for the claimant and not any other customer. Neither you nor we may bring claims as a plaintiff or class member in any purported class, representative or private attorney general proceeding. Unless you and we agree otherwise, the arbitrator may not consolidate more than one person\'s claims and may not award declaratory or injunctive relief that would affect other customers or that is not essential to provide relief for your or our individual claim. If any provision of this paragraph is found to be unenforceable, then the entirety of this arbitration provision shall be null and void. </strong></span></li></ul></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><span style=\"font-size: 10pt;\"><strong>18. Termination </strong></span></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><ul><li><span style=\"font-size: 10pt;\">The Terms of Service will remain in full force and effect until terminated by either you or ApiTap. If you wish to terminate, you may do so by closing your ApiTap Account by contacting the customer service department by logging in at www.nomorecards.com. </span></li></ul></div><div><ul><li><span style=\"font-size: 10pt;\">We reserve the right at any time to modify or discontinue, temporarily or permanently, the ApiTap Services with or without notice. You agree that we shall not be liable to you or to any third party for any modification, suspension, or discontinuance of the ApiTap Services. </span></li></ul></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><span style=\"font-size: 10pt;\"><strong>19. Miscellaneous Provisions </strong></span></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><ul><li><span style=\"font-size: 10pt;\">The Terms and Conditions of this Consumer Service Agreement contains the entire agreement between you and ApiTap pertaining to your use of the ApiTap Platform, and expressly exclude any writings, representations, agreements or understandings not specifically captured or contained herein, whether written or oral. The Terms of Service are governed by the U.S. Federal Arbitration Act, applicable U.S. federal law, and the laws of the U.S. state or territory in which you are domiciled, without regard to the conflicts of laws rules of that state or territory. If any part of the Terms of Service is held to be invalid under the law of a particular U.S. state or territory, that provision will not apply in that U.S. state or territory, and its invalidity will not affect the validity of the balance of the Terms of Service, which shall remain valid and enforceable according to their terms. The failure to enforce any of the Terms of Service on one occasion shall not prevent enforcement on any other occasion or the enforcement of any other term. Headings and captions shall not be considered included for purposes of interpretation or application hereof, but are for convenience only. You may not assign the Terms of Service without our prior written consent.</span></li></ul></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><span style=\"font-size: 10pt;\"><strong>20. Privacy and Your Personal Information </strong></span></div><div><span style=\"font-size: 10pt;\"><br/></span></div><div><ul><li><span style=\"font-size: 10pt;\">Please read our privacy policy at www.apitap.com/privacy. Our Privacy Policy explains how we use and safeguard your data when you use the ApiTap Services. You agree to our use of your data in accordance with our Privacy Policy.</span></li></ul><div><br/></div></div>','<span class=\"ui-provider yl b c d e f g h i j k l m n o p q r s t bhe bhf w x y z ab ac ae af ag ah ai aj ak\" dir=\"ltr\"><span style=\"font-family: \"Segoe UI\", system-ui, \"Apple Color Emoji\", \"Segoe UI Emoji\", sans-serif; font-size: 14px;\"></span></span><ol style=\"font-size: 14.6667px; font-style: inherit; font-weight: inherit; margin-right: 0px;\"><li style=\"font-size: 11pt; margin-left: 18pt; font-style: inherit; font-weight: inherit;\"><span style=\"font-size: 10.5pt; font-style: inherit; font-weight: inherit;\">ALL SALES ARE FINAL ONCE THE ITEM IS AUTHENTICATED AND DELIVERED, AND NO REFUND REQUESTS WILL BE HONORED REGARDLESS OF THE CURRENT VALUE OF THE ITEM, UNLESS PROVIDED UNDER THE APPLICABLE LAW.</span></li></ol>\r\n<p><br/></p>','<div style=\"font-size: 10pt; text-align: center;\"><font face=\"Arial, Verdana\"><strong>Your privacy is important to us. Please take a moment to review our Privacy Policy.</strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">This Privacy Policy describes the way ApiTap uses and protects the information we collect about Customers and Users. This Privacy Policy does not cover information that you provide to third parties directly. We encourage you to review the privacy policies of any third party to whom you provide information to understand what information will be collected, and how it will be used or disclosed to others.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">This Privacy Policy applies to the ApiTap Platform. When we refer to<strong> ApiTap Platform</strong> in this Privacy Policy we mean: (i) the ApiTap application (app) installed on your mobile device; (ii) your ApiTap User account; (iii) the ApiTap web management tools available to you at our website, www.apitap.com and (iv) other related features and services provided by ApiTap or its affiliates.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">As used in this Privacy Policy:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>User </strong>is an individual or business who activates the ApiTap Platform and a User is also anyone who visits the Website.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Personal Information </strong>is information that directly identifies or reasonably can be used to identify an individual User. Personal Information does not include Anonymous or Aggregated Information.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Anonymous Information</strong> means information that does not directly identify and cannot reasonably be used to identify an individual User.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Aggregated Information</strong> means information about groups or categories of Users that does not directly identify and cannot reasonably be used to identify an individual User. Aggregated Information is a kind of Anonymous Information.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Locations Services </strong>are electronic services used by mobile and web-based devices or applications that are used to determine a user’s current locations. This may take the form of activating and reading a mobile device’s GPS (Global Positioning System) data or by retrieving the information as provided by an (ISP) internet service provider.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Payment Cards</strong> are credit, debit and prepaid cards and other types of payment products.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Participating Issuer</strong> is a financial institution that issues Payment Cards and is participating in the ApiTap Platform.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Participating Merchant</strong> is a merchant that is enabled to participate in the ApiTap Platform.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">You will be able to view our Privacy Policy at any time through the “About ApiTap” sections of our mobile app and website. In addition, if you establish an ApiTap Account, we will also send a link to the Privacy Policy to the email address you provided us when you established your ApiTap Account.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"> </font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>The ApiTap Platform</strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">ApiTap has developed a mobile payment, promotional, and commerce platform that utilizes smartphone, contactless, Bluetooth, and near-field communication (NFC) technology, among others, to enable you to use the ApiTap Platform to:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Complete purchase transactions using prepaid, credit, debit or other payment products; and</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Receive certain offers, coupons and loyalty cards from participating retailers, food establishments, manufacturers, brands and other marketers</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Become involved in social networks developed around shopping and entertainment</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Experience traditional “in person” retail benefits including, but not limited to, in-store promotions and specials, advertising, sales assistance and on-site ordering.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Personal Information Collected When You Use the ApiTap Platform</strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We collect Personal Information in a variety of ways, including:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"white-space: pre;\">	</span>• You provide it to us when you:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"white-space: pre;\">		</span>• activate your ApiTap account,</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"white-space: pre;\">		</span>• use the ApiTap Platform, or</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"white-space: pre;\">		</span>• interact with Customer care;</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• We collect data when you visit our websites and use our mobile application to provide you with a better and more customized user experience.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• We also obtain data from other sources (third parties), in connection with the operation of the ApiTap Platform.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"white-space: pre;\">	</span>We collect the following types of information, including Personal Information:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">When you establish an ApiTap Account, we collect the information you provide; including but not limited to your name, email address, ApiTap password and contact phone number.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Once you have established your ApiTap Account, we collect information we may receive from your mobile device, if used with ApiTap, such as your device type and your mobile device ID number. These are used to identify you on our system properly.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">When you choose to load a Payment Card offered by a Participating Issuer, we collect the type and brand of Payment Card used (for example, type may include credit, debit or prepaid, and brand may include MasterCard, Visa, American Express, Discover), the Payment Card issuer (for example, the Participating Issuer issuing the Payment Card), and Payment Card account numbers, billing address, and expiration dates.</font></li></ul></div><div><ul style=\"font-size: 10pt;\"><li><font face=\"Arial, Verdana\">When a Payment Card is used, we collect the fact that a particular Payment Card was used, the location it was used at, the time and date of the transaction, and the identity of the Participating Merchant where the Payment Card was used.<span style=\"white-space: pre;\">	</span></font></li></ul><ul style=\"font-size: 10pt;\"><li><font face=\"Arial, Verdana\">For other prepaid cards, in addition to the above information, we may also collect the card balance; and other data shared by the issuer.</font></li></ul><ul style=\"font-size: 10pt;\"><li><font face=\"Arial, Verdana\">We may receive information about the status of your Payment Card (for example, whether it is suspended or cancelled) from your Payment Card issuer.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">When you choose to \"Follow\" a Participating Merchant, we collect which merchant you \"Follow\" in order to provide you with offers and notifications from that Participating Merchant.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">If you choose to add a Participating Merchant loyalty card, we collect information such as the Participating Merchant and the loyalty card number; by adding a loyalty card to your ApiTap Wallet you are choosing to \"Follow\" that Participating Merchant.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">When you choose to provide your zip code or allow the use of location services, we collect that information in order to better provide you with local or targeted offers for your geographic area.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">We also keep track of information about which offers you\'ve selected and used (for example, if you use an offer, we note the fact that the offer was presented by you to the Participating Merchant); and</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">If you use a Payment Card or a loyalty card in connection with an offer that you present, we will collect the fact that a particular Payment Card or loyalty card was used in connection with that particular offer.</font></li></ul></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">When you call Customer Care or login to the Website for customer care, we may collect information, including Personal Information, as follows:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information you may provide to us for the administration, maintenance and use of your ApiTap Account and the ApiTap Platform. This information may include a new email address, new password, Security Questions and Answers or any other information you provide.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">At no time will a ApiTap representative ever ask you for your account password or mobile access pin code.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information on whether your ApiTap account was suspended or terminated; and</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information about your interaction with the ApiTap Platform that may help us protect you from fraud and other misconduct or address the issue you contacted us about.</font></li></ul></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">When you visit our Website, we may collect information, including Personal Information, as follows:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information you provide, such as your name, mailing address, email address, phone number(s) and unique identifiers (such as your user login and password);</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information you provide if you apply for a job, such as your resume and other employment-related information; and</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Information about your use of our Website</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Commonly available browser-based information including, but not limited to, type of browser and basic system data and device location (using location services) as provided by the browser.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">We may use what are referred to as “cookies”, which are browser-oriented pieces of code, to allow us to recognize users in order to provide faster and better service and features during subsequent visits.</font></li></ul></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We may collect this information either when you provide it directly or through the use of:</font></div><div style=\"font-size: 10pt;\"><br/></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Cookies or similar technologies to identify the computer or device, and to improve the quality of ApiTap Services.</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Web-beacons (small graphic images on a Web page or an HTML e-mail that are generally invisible); and</font></li></ul></div><div style=\"font-size: 10pt;\"><ul><li><font face=\"Arial, Verdana\">Software to collect data about your interactions with the Website, such as the time of your visit and whether you have visited the Website before.</font></li></ul></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">You can manage cookies by using features and functions available on most Internet browsers. For example, most browsers will allow you to choose what cookies can be placed on your computer and to delete or disable cookies. You can find instructions for managing cookie controls on websites for particular browsers. Please note that disabling cookies may prevent you from using specific features on our Website.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">If we combine or link cookie or web beacon information with Personal Information, we will treat the combined or linked information as Personal Information under this Privacy Policy.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We may advertise our products and services on third party websites. The use of cookies, Web-beacons or similar technologies by such third parties is subject to their privacy policies - not this  </font>Privacy Policy.</div><div style=\"font-size: 10pt;\"><br/></div><div style=\"font-size: 10pt;\"><br/></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Use of Your Personal Information</strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong><br/></strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We use the information we collect, including Personal Information, in a variety of ways. For example, we may use some or all of the information, including Personal Information, we collect to:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Provide ApiTap Services, including account specific customized functionality</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Notify you about ApiTap Service announcements, software updates, changes to the Terms of Service or the Privacy Policy, service alerts or other communication messages in connection with your ApiTap Platform user account and usage.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Develop, maintain and improve ApiTap Services, and to perform data analysis and research for those purposes.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Investigate, prevent, or take action regarding violations of the Terms of Service or the terms and conditions on our Website or other acceptable use policies provided to you from time to time.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Help ensure security and quality control, and for troubleshooting purposes.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Comply with legal or regulatory requirements.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Respond to regulatory authorities and auditors.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Respond to a subpoena, court order or to establish our legal rights and defend against legal claims or other legal obligations.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Protect against or prevent fraud/identity theft or other illegal activities.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Manage risk and operability issues</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Otherwise operate our business as permitted by law.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We may also use Aggregated Information and Anonymous Information for various purposes such as to perform data analysis and research for the purpose of developing, maintaining and improving ApiTap Services; to evaluate the helpfulness of ApiTap messaging; to assess the effectiveness of offers provided by ApiTap on behalf of Participating Merchants and other third parties; and to market and advertise ApiTap products and services.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">If you submit a job application or resume or send a request via the Website, we use Personal Information to communicate with you and, subject to applicable law, to make current hiring decisions, to make future hiring decisions (applicant information is retained for purposes of future job openings unless an applicant indicates otherwise) and to comply with legal obligations, including regarding hiring and workforce diversity.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong>Sharing of Personal Information with Third Parties</strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><strong><br/></strong></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We share information we collect, including Personal Information, with third parties who assist us in providing services and performing the activities described under the \"Use of your Personal Information\" heading above. Whenever we share with third parties who perform services for us or on our behalf, we require them to agree to maintain appropriate safeguards designed to protect the security and the confidentiality of the Personal Information that we provide to them. We also limit their use of the Personal Information to performing the services requested and limit the circumstances in which they may share the Personal Information with others.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">We also may share your information, including Personal Information, with certain third parties (such as government agencies) as necessary to:</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Comply with legal or regulatory requirements.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Respond to a subpoena, court order or to establish our legal rights and defend against legal claims or other legal obligations.</font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\"><br/></font></div><div style=\"font-size: 10pt;\"><font face=\"Arial, Verdana\">• Protect