d pioneer in jewelry design since 1979, world-renowned jewelry expert Leon Haytayan created the Leon’s brand in 2000 to showcase his one-of-a-kind masterpieces and unique treasures.</span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Just as in olden times - when master artists were commissioned to create portraits and paintings - every jewelry piece is hand-made by Leon himself for each client that commissions a design. This ensures that the fortunate collector is acquiring a precious heirloom created by a master, and one that can be handed down from generation to generation for years of enjoyment and admiration.</span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Working with only the purest and finest in precious metals and stones, Leon’s spares no expense in the worldwide search for the best in working materials. Michelangelo spent years perfecting the priceless art within the Sistine Chapel. So too does Leon work tirelessly to perfect each creation. Every precious diamond and each colorful jewel that he works with undergoes a microscopic analysis before being anointed as the ‘chosen one’ to be transformed by his creative artistry into a magnificent completed piece.</span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">With this attention to detail, it only makes sense that Leon’s stands behind its masterpieces and offers what no other jewelry creator in the world would be bold enough to guarantee: a lifetime warranty. This is NOT a limited time (like a 3 year/36,000 mile) offer. In fact, we have so much confidence in our products that we will cover full service and maintenance, and resolve any issues that occur with our pieces forever!</span></font></div>',0,NULL,4701,NULL,'en',NULL,1,0,'<div style=\"text-align: center;\"><div style=\"\"><font face=\"Arial, Verdana\" style=\"\" size=\"5\"><strong>Terms and Conditions of Use</strong></font></div><div style=\"font-weight: normal; font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Service Agreement Effective. 01/25/2022&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Welcome to the Apitap (\"Apitap\", “APITAP”, \"We\", \"Our\") Social Commerce Platform comprising web sites, web widgets, mobile applications, and any other mobile or web services or applications owned, controlled, or offered by Apitap (collectively, the \"Apitap Platform\"). Subscribers, customers, users, and others who download, access, use, purchase and/or subscribe to the Apitap Services (collectively or individually \"You\", “Your”, or \"Users\") must do so under the following terms and conditions of use.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">BEFORE USING ANY OF THE APITAP PLATFORM or SERVICES, PLEASE READ