and other telecommunications carriers.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may need share certain information with these third parties in order to provide Apitap Services. You explicitly permit such sharing with those third parties in order to deliver the Apitap Services to you as set forth in the Privacy Policy.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">6. Apitap User Roles and Permissions/Managing Accounts.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You can access and manage your Apitap Account at any device from which you are able to access the Internet and may access Apitap via a common web browser.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">7. Apitap does not do the following:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Set the terms of any purchase, payment, expiration date, or other transaction between you and any Participating Merchant or Participating Issuer; nor do the Terms of Service in any way modify any separate agreement you may have with any third party, including a Commerce Activity Contract, Wireless Service Contract or Cardholder Agreement;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Process payments, or in any way act as or provide the services of a bank or other financial institution or Participating Issuer;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Insure, endorse or assume any liability for any products or services you purchase or use by means of the Apitap app; or,&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Control or have any liability for payments, returns, refunds, charge-backs, Commerce Activities or any questions or disputes you may have with any Participating Merchant or Participating Issuer related to any purchase, or with a Wireless Service Provider related to your use of the Apitap app, Platform or otherwise.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">8. Updates.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may from time to time provide updates to the Apitap Platform. These updates may be provided automatically \"over the air\" and are designed to improve, enhance and further develop the Apitap Platform. These updates may take the form of revisions to the Terms of Service or Privacy Policy, and can include Electronic Communications, bug fixes, enhanced functions and new software modules. You agree to receive and install such updates (and permit us to deliver these to you) as part of your use of the Apitap Platform.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">9. Apitap Precautions.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">To help ensure your safety when using the Apitap app please keep in mind the following:&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Do not use the Apitap app while driving or operating machinery as such use may result in injury to both you and others;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Make sure you safeguard your Apitap Password and/or PIN to avoid unauthorized use.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">10. Usage Fees and Charges&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Consumer is responsible for all charges applicable to its account, including but not limited to all usage-based charges, irrespective of whether such arise as a result of fraud, non-payment on the part of any of Consumers Affiliates or other permitted users, pursuant to this Agreement, or for any other reason except as expressly provided herein&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap does not charge consumers additional fees related to the general use of the Apitap platform. However, in the future Apitap may offer services or special benefits for consumers that may require an additional charge or recurring fee, at that time, in order for consumers to use or participate with them. We reserve the right to provide these paid services or benefits in the future, and will notify the consumer as they become available&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Possible Wireless Service Provider Fees and Charges; Data Limit Applicability. Your Wireless Service Provider may charge you for text messages and/or data transmitted to or from your Mobile Device. Text messaging and data transmissions also may be applied against data usage limits set by your Wireless Service Provider and you are solely responsible for such charges. Those messages and transmissions and related charges may be triggered by your usage of the Apitap app (changes to your security credentials, for example) as well as updates to the Apitap app may appear on your Wireless Service Provider bill pursuant to your Wireless Service Contract. Additionally, roaming and other fees and charges may apply when roaming outside your home service area, including when using your Apitap app internationally. You should contact your Wireless Service Provider for complete pricing and other details.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Other Possible Third-Party Fees and Charges. Participating Issuers and Participating Merchants also may assess fees and charges such as annual fees in connection with their Payment Cards and Commerce Activities; you should contact your Participating Issuers or Participating Merchants for complete pricing and other details.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">11. Your Apitap Account and Security&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weig