gn: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">12. Communicating with you Electronically&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may communicate information, notices, messages, service alerts, announcements, agreements, disclosures or other communications (\"Electronic Communications\") associated with the Apitap Platform to you electronically through the Apitap app, by e-mailing such Electronic Communications to the e-mail address on file in your Apitap Account, or sending you such Electronic Communications via text message to your Mobile Device. Electronic Communications may result in usage fees and charges from your Wireless Service Provider.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Electronic Communications shall be deemed to be received by you when they are sent, provided, posted or otherwise communicated to you in accordance with the Terms of Service. You agree to keep your email address and other contact information up to date with us in order that we may communicate with you.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Your consent to receive Electronic Communications from us does not mean that we must provide all communications electronically. Apitap may, at our option, deliver communications on paper or through other means if we choose to 