ers or third parties<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">THIS\r\nSERVICE IS PROVIDED \"AS IS\" AND WE MAKE NO WARRANTY OF ANY\r\nKIND, EXPRESS OR IMPLIED, INCLUDING ANY IMPLIED WARRANTY OF\r\nMERCHANTABILITY OR FITNESS FOR A PARTICULAR PURPOSE, IN CONNECTION\r\nWITH THE SERVICES PROVIDED TO YOU UNDER THIS AGREEMENT. WE DO NOT AND\r\nCANNOT WARRANT THAT THE SERVICE WILL OPERATE WITHOUT ERRORS OR THAT\r\nTHE SERVICE WILL BE AVAILABLE AND OPERATIONAL AT ALL TIMES. WE ARE\r\nNOT RESPONSIBLE FOR THE QUALITY, SAFETY, LEGALITY, OR ANY OTHER\r\nASPECT OF ANY GOODS OR SERVICES YOU PURCHASE THROUGH THE USE OF THIS\r\nSERVICE.<br/></font></font><font face=\"Arial, serif\">(d)</font><font color=\"#000000\"><font face=\"Arial, serif\">You\r\nacknowledge and agree if we do not complete a transaction, or\r\ncomplete a transaction incorrectly, we will be liable for your\r\nindividual losses or damages up to the value of the transaction.\r\nHowever, there are some exceptions. To the extent allowed by law, we\r\nwill not be liable for consequential damages (including lost\r\nprofits), extraordinary damages, special or punitive damages. We will\r\nnot be liable, for instance: (i) If, through no fault of ours, you do\r\nnot have enough money in your account to make the transfer or\r\ncomplete a transaction; (ii) If an electronic terminal or online\r\npoint of purchase (e-commerce system) where you are making a\r\ntransaction does not operate properly; (iii) If access to your\r\naccount has been blocked or suspended; (iv) If there is a hold or the\r\nfunds in your account are subject to legal process or other\r\nencumbrance restricting their use; (v) If we have reason to believe\r\nthe requested transaction is unauthorized or fraudulent; (vi) If\r\ncircumstances beyond our control (such as fire, flood or computer or\r\ncommunication failure) prevent the completion of the transaction,\r\ndespite reasonable precautions that we have taken.<br/><br/></font></font><font face=\"Arial, serif\">4.03\r\nMerchant Acknowledgment. </font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nacknowledges that the limited warranty, the exclusive remedies and\r\nlimited liability set out herein are fair and reasonable in the\r\ncommercial circumstances of this Agreement.<br/><br/></font></font><font face=\"Arial, serif\"><u>ARTICLE\r\n5: CONFIDENTIALITY AND OWNERSHIP</u></font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font face=\"Arial, serif\"> Each\r\nparty agrees to keep confidential any and all information with\r\nrespect to the other party which has received or may in the future\r\nreceive in connection with this Agreement, which shall include\r\nwithout limitation, the terms and conditions of this Agreement and,\r\nwith regard to ATLA, LLC. Confidential Information includes any\r\ninformation with regard to the Services which ATLA, LLC. provides to\r\nMerchant (the “Confidential Information”) and shall only disclose\r\nsuch information (i) to its agents, employees or representatives who\r\nhave a need to know such information, for the purpose of performance\r\nunder this Agreement and exercising the rights granted under this\r\nAgreement and who have executed a nondisclosure agreement at least as\r\nprotective of the disclosing party\"s Confidential Information as\r\nthis Agreement, or (ii) to the extent required by applicable law or\r\nduring the course of or in connection with any litigation,\r\narbitration or other proceeding based upon or in connection with the\r\nsubject matter of this Agreement, provided that the receiving party\r\nshall give the disclosing party reasonable notice prior to such\r\ndisclosure and shall comply with any applicable protective order or\r\nequivalent.<br/></font></font><font face=\"Arial, serif\">(b)</font><font color=\"#000000\"><font face=\"Aria