 1.04 and Articles 2, 4, 5 and 6<br/></font></font><font face=\"Arial, serif\">7.09\r\nSub-Contracting. </font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. reserves the right to sub-contract any part of a Service,\r\nprovided such third party agreements are bound by the terms of this\r\nAgreement and ATLA, LLC. retains responsibility for any such\r\nsubcontracted Services.<br/><br/></font></font></font><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in\" align=\"CENTER\"><font size=\"2\"><font face=\"Arial, serif\">MERCHANT\r\nSERVICES TERMS AND CONDITIONS</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/></font></font></font><br/>\r\n</p>\r\n','\r\n<p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\" align=\"CENTER\">\r\n<font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><b>RETURNED\r\n- MERCHANDISE AND REFUND POLICY</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in\"><font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/>Please\r\nnote: The following return and refund policies may have additional\r\nterms, details, or conditions which may apply. Please review our full\r\nMerchant Use Terms and Conditions for additional details and\r\nconditions concerning payment and refund policies, as\r\napplicable.<br/><br/>Any and all merchandise returned to ATLA, LLC must\r\nbe; in it\'s original packaging, cannot be damaged, must have all\r\noriginally included accessories, and everything must be in like new\r\ncondition and working order.<br/><br/>If the merchandise fails any of\r\nthese conditions, without prior approval from ATLA, LLC, then it will\r\nbe returned to the merchant at the merchant\'s expense and no refund\r\nwill be issued. If the return is accepted, then the merchandise will\r\nbe subject to a 20% restocking fee.<br/><br/>Each service subscription\r\n(location or online) a merchant has must be cancelled individually.\r\nThe first 30 days (month) of subscription service is subject to a 30\r\nday money back guarantee, in the event the merchant wishes to cancel\r\ntheir service during that first 30 days. After that, merchants have\r\nuntil seven (7) days before their renewal date to cancel a\r\nsubscription for the following month. If we do not have a\r\ncancellation notice by then, then the subscription will automatically\r\nrenew and payment processed five (5) days before the renewal date. No\r\nrefunds will be issued for subscriptions not canceled within the time\r\nlimit.<br/></font></font></font><br/>\r\n</p>\r\n','<p style=\"margin-bottom: 0in; line-height: 100%\" align=\"CENTER\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Your\r\nprivacy is important to us. Please take a moment to review our\r\nPrivacy Policy.</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">This\r\nPrivacy Policy describes the way Apitap uses and protects the\r\ninformation we collect about Customers and Users. This Privacy Policy\r\ndoes not cover information that you provide to third parties\r\ndirectly. We encourage you to review the privacy policies of any\r\nthird party to whom you provide information to understand what\r\ninformation will be collected, and how it will be used or disclosed\r\nto others.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">This\r\nPrivacy Policy applies to the Apitap Platform. When we refer\r\nto</font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b> Apitap\r\nPlatform</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> in\r\nthis Privacy Policy we mean: (i) the Apitap application (app)\r\ninstalled on your mobile device; (ii) your Apitap User account; (iii)\r\nthe Apitap web management tools available to you at our website,\r\nwww.Apitap.com and (iv) other related features and services provided\r\nby Apitap or its affiliates.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">As\r\nused in this Privacy Policy:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><strong>User </strong></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">is\r\nan individual or business who activates the Apitap Platform and a\r\nUser is also anyone who visits the Website.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Personal\r\nInformation </b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">is\r\ninformation that directly identifies or reasonably can be used to\r\nidentify an individual User. Personal Information does not include\r\nAnonymous or Aggregated Information.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Anonymous\r\nInformation</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> means\r\ninformation that does not directly identify and cannot reasonably be\r\nused to identify an individual User.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Aggregated\r\nInformation</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> means\r\ninformation about groups or categories of Users that does not\r\ndirectly identify and cannot reasonably be used to identify an\r\nindividual User. Aggregated Information is a kind of Anonymous\r\nInformation.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Locations\r\nServices </b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">are\r\nelectronic services used by mobile and web-based devices or\r\napplications that are used to determine a user’s current locations.\r\nThis may take the form of activating and reading a mobile device’s\r\nGPS (Global Positioning System) data or by retrieving the information\r\nas provided by an (ISP) internet service provider.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Payment\r\nCards</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> are\r\ncredit, debit and prepaid cards and other types of payment products.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Participating\r\nIssuer</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> is\r\na financial institution that issues Payment Cards and is\r\nparticipating in the Apitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Participating\r\nMerchant</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> is\r\na merchant that is enabled to participate in the Apitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">You\r\nwill be able to view our Privacy Policy at any time through the\r\n“About Apitap” sections of our mobile app and website. In\r\naddition, if you establish an Apitap Account, we will also send a\r\nlink to the Privacy Policy to the email address you provided us when\r\nyou established your Apitap Account.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"> </font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>The\r\nApitap Platform</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Apitap\r\nhas developed a mobile payment, promotional, and commerce platform\r\nthat utilizes smartphone, contactless, Bluetooth, and near-field\r\ncommunication (NFC) technology, among others, to enable you to use\r\nthe Apitap Platform to:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Complete purchase transactions\r\nusing prepaid, credit, debit or other payment products; and</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Receive certain offers,\r\ncoupons and loyalty cards from participating retailers, food\r\nestablishments, manufacturers, brands and other marketers</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Become involved in social\r\nnetworks developed around shopping and entertainment</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Experience traditional “in\r\nperson” retail benefits including, but not limited to, in-store\r\npromotions and specials, advertising, sales assistance and on-site\r\nordering.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Personal\r\nInformation Collected When You Use the Apitap Platform</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\ncollect Personal Information in a variety of ways, including:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">	•\r\nYou provide it to us when you:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\nactivate your Apitap account,</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\nuse the Apitap Platform, or</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\ninteract with Customer care;</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">We collect data when you visit\r\nour websites and use our mobile application to provide you with a\r\nbetter and more customized user experience.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">We also obtain data from other\r\nsources (third parties), in connection with the operation of the\r\nApitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">	We\r\ncollect the following types of information, including Personal\r\nInformation:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you establish an Apitap Account, we collect the information you\r\n	provide; including but not limited to your name, email address,\r\n	Apitap password and contact phone number.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Once\r\n	you have established your Apitap Account, we collect information we\r\n	may receive from your mobile device, if used with Apitap, such as\r\n	your device type and your mobile device ID number. These are used to\r\n	identify you on our system properly.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to load a Payment Card offered by a Participating Issuer,\r\n	we collect the type and brand of Payment Card used (for example,\r\n	type may include credit, debit or prepaid, and brand may include\r\n	MasterCard, Visa, American Express, Discover), the Payment Card\r\n	issuer (for example, the Participating Issuer issuing the Payment\r\n	Card), and Payment Card account numbers, billing address, and\r\n	expiration dates.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When a\r\n	Payment Card is used, we collect the fact that a particular Payment\r\n	Card was used, the location it was used at, the time and date of the\r\n	transaction, and the identity of the Participating Merchant where\r\n	the Payment Card was used.	</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">For\r\n	other prepaid cards, in addition to the above information, we may\r\n	also collect the card balance; and other data shared by the issuer.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We may\r\n	receive information about the status of your Payment Card (for\r\n	example, whether it is suspended or cancelled) from your Payment\r\n	Card issuer.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to \"Follow\" a Participating Merchant, we\r\n	collect which merchant you \"Follow\" in order to provide\r\n	you with offers and notifications from that Participating Merchant.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If you\r\n	choose to add a Participating Merchant loyalty card, we collect\r\n	information such as the Participating Merchant and the loyalty card\r\n	number; by adding a loyalty card to your Apitap Wallet you are\r\n	choosing to \"Follow\" that Participating Merchant.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to provide your zip code or allow the use of location\r\n	services, we collect that information in order to better provide you\r\n	with local or targeted offers for your geographic area.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We also\r\n	keep track of information about which offers you\'ve selected and\r\n	used (for example, if you use an offer, we note the fact that the\r\n	offer was presented by you to the Participating Merchant); and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If you\r\n	use a Payment Card or a loyalty card in connection with an offer\r\n	that you present, we will collect the fact that a particular Payment\r\n	Card or loyalty card was used in connection with that particular\r\n	offer.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\nyou call Customer Care or login to the Website for customer care, we\r\nmay collect information, including Personal Information, as follows:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you may provide to us for the administration, maintenance and use of\r\n	your Apitap Account and the Apitap Platform. This information may\r\n	include a new email address, new password, Security Questions and\r\n	Answers or any other information you provide.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">At no\r\n	time will a Apitap representative ever ask you for your account\r\n	password or mobile access pin code.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	on whether your Apitap account was suspended or terminated; and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	about your interaction with the Apitap Platform that may help us\r\n	protect you from fraud and other misconduct or address the issue you\r\n	contacted us about.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\nyou visit our Website, we may collect information, including Personal\r\nInformation, as follows:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you provide, such as your name, mailing address, email address,\r\n	phone number(s) and unique identifiers (such as your user login and\r\n	password);</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you provide if you apply for a job, such as your resume and other\r\n	employment-related information; and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	about your use of our Website</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Commonly\r\n	available browser-based information including, but not limited to,\r\n	type of browser and basic system data and device location (using\r\n	location services) as provided by the browser.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We may\r\n	use what are referred to as “cookies”, which are\r\n	browser-oriented pieces of code, to allow us to recognize users in\r\n	order to provide faster and better service and features during\r\n	subsequent visits.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nmay collect this information either when you provide it directly or\r\nthrough the use of:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Cookies\r\n	or similar technologies to identify the computer or device, and to\r\n	improve the quality of Apitap Services.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Web-beacons\r\n	(small graphic images on a Web page or an HTML e-mail that are\r\n	generally invisible); and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Software\r\n	to collect data about your interactions with the Website, such as\r\n	the time of your visit and whether you have visited the Website\r\n	before.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">You\r\ncan manage cookies by using features and functions available on most\r\nInternet browsers. For example, most browsers will allow you to\r\nchoose what cookies can be placed on your computer and to delete or\r\ndisable cookies. You can find instructions for managing cookie\r\ncontrols on websites for particular browsers. Please note that\r\ndisabling cookies may prevent you from using specific features on our\r\nWebsite.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If\r\nwe combine or link cookie or web beacon information with Personal\r\nInformation, we will treat the combined or linked information as\r\nPersonal Information under this Privacy Policy.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nmay advertise our products and services on third party websites. The\r\nuse of cookies, Web-beacons or similar technologies by such third\r\nparties is subject to their privacy policies - not this  Privacy\r\nPolicy.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Use\r\nof Your Personal Information</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nuse the information we collect, including Personal Information, in a\r\nvariety of ways. For example, we may use some or all of the\r\ninformation, including Personal Information, we collect to:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Provide Apitap Services,\r\nincluding account specific customized functionality</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Notify you about Apitap\r\nService announcements, software updates, changes to the Terms of\r\nService or the Privacy Policy, service alerts or other communication\r\nmessages in connection with your Apitap Platform user account and\r\nusage.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Develop, maintain and improve\r\nApitap Services, and to perform data analysis and research for those\r\npurposes.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Investigate, prevent, or take\r\naction regarding violations of the Terms of Service or the terms and\r\nconditions on our Website or other acceptable use policies provided\r\nto you from time to time.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Help ensure security and\r\nquality control, and for troubleshooting purposes.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Comply with legal or\r\nregulatory requirements.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Respond to regulatory\r\nauthorities and auditors.</font></font></font></p>\r\n<p