ial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to stolen goods including digital and virtual goods&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that promote hate, violence, racial intolerance, or the financial exploitation of a crime&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that are considered obscene, as defined by local, state and federal laws where you reside.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to items that infringe or violate any copyright, trademark, right of publicity or privacy or any other proprietary right under the laws of any jurisdiction&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to certain sexually oriented materials or services, not covered in 4.a.i&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to ammunition, firearms, or certain firearm parts or accessories, or certain weapons or knives regulated under applicable law.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Relate to transactions that show the personal information of third parties in violation of applicable law&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Support pyramid or Ponzi schemes, matrix programs, other \"get rich quick\" schemes or certain multi-level marketing programs.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">5. The Apitap Platform&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap has developed a social commerce platform (referred to as the Apitap Platform that utilizes mobile technology, that includes but is not limited to contactless and/or near-field communications (NFC) to enable you to use your Mobile Device or a web site to complete purchase transactions using prepaid, credit, debit or other payment products (we refer to these products as Payment Cards). The Apitap Platform also allows you to receive commerce benefits from participating retailers, food establishments, and other merchants. The Apitap Platform is part of the system-enabled Participating Merchants.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap Platform also enables you to use various offers and loyalty promotions that are made available to you by Participating Merchants. We refer to these offers, coupons and loyalty cards as Loyalty Programs. We refer to any agreement between you and a Participating Merchant, such as a loyalty card agreement, as a Commerce Activity Contract&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span 