guard your Apitap Password and/or PIN to avoid unauthorized use.&nbsp;&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">10. Usage Fees and Charges&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Consumer is responsible for all charges applicable to its account, including but not limited to all usage-based charges, irrespective of whether such arise as a result of fraud, non-payment on the part of any of Consumers Affiliates or other permitted users, pursuant to this Agreement, or for any other reason except as expressly provided herein&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap does not charge consumers additional fees related to the general use of the Apitap platform. However, in the future Apitap may offer services or special benefits for consumers that may require an additional charge or recurring fee, at that time, in order for consumers to use or participate with them. We reserve the right to provide these paid services or benefits in the future, and will notify the consumer as they become available&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><sp