OF SUCH LOSS OR DAMAGE OR ANY CLAIM BY ANY THIRD PARTY.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">WE SHALL NOT BE LIABLE EVEN IF WE ARE UNABLE TO PROVIDE THE Apitap SERVICES (OR ANY PART THEREOF) OR PERFORM ANY OF OUR OBLIGATIONS CONTAINED IN THE TERMS OF SERVICE DUE TO, DIRECTLY OR INDIRECTLY, THE FAILURE OF ANY EQUIPMENT OR ANY INDUSTRIAL DISPUTE, WAR, FLOOD, EXPLOSION, ACT OF GOD, OTHER FORCE MAJEURE OR ANY OTHER EVENT BEYOND OUR CONTROL.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">APITAP DISCLAIMS, TO THE FULLEST EXTENT PERMITTED BY LAW, ALL REPRESENTATIONS AND WARRANTIES REGARDING THE APITAP SERVICES, WHETHER EXPRESSED OR IMPLIED, INCLUDING BUT NOT LIMITED TO WARRANTIES OF MERCHANTABILITY, FITNESS FOR ANY PARTICULAR PURPOSE AND NON-INFRINGEMENT OF PROPRIETARY RIGHTS. THE TERMS OF SERVICE CONTAIN OTHER DISCLAIMERS, LIMITATIONS AND EXCLUSIONS THAT MAY NOT BE ALLOWED IN CERTAIN JURISDICTIONS, AND THUS NOT APPLICABLE TO YOU.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">IN ADDITION, NOTWITHSTANDING ANYTHING TO THE CONTRARY HEREIN, ALTHOUGH WE WILL TAKE REASONABLE PRECAUTIONS TO PROTECT THE Apitap SERVICES AND AVOID DELETION, CORRUPTION OR UNAUTHORIZED MODIFICATION OR ACCESS OF OR TO THE APITAP SERVICES (OR ANY DATA STORED IN OR TRANSMITTED THROUGH THE APITAP SERVICES), WE MAKE NO REPRESENTATION OR WARRANTY THAT SUCH EFFORTS WILL BE SUCCESSFUL, AND WE SPECIFICALLY DISCLAIM ALL LIABILITY WHATSOEVER WITH RESPECT TO ANY FAILURE TO PROTECT THE APITAP SERVICES OR PROVIDE THE APITAP SERVICES ERROR-FREE OR UNINTERRUPTED.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">IF, DESPITE THE FOREGOING PROVISIONS, LIABILITY IS NEVERTHELESS IMPOSED ON APITAP, OR THEIR RESPECTIVE PARENT COMPANIES, SUBSIDIARIES OR AFFILIATES, OR ON ANY OF THEIR RESPECTIVE MANAGERS, WIRELESS SERVICE PROVIDERS, EMPLOYEES, REPRESENTATIVES, AGENTS, LICENSORS, SUCCESSORS OR ASSIGNS, IN NO EVENT WILL THE AGGREGATE LIABILITY OF ANY OF THE FOREGOING ENTITIES OR INDIVIDUALS UNDER OR IN CONNECTION WITH THE TERMS OF SERVICE OR OUR PROVISION OF THE APITAP SERVICES EXCEED ONE HUNDRED DOLLARS ($100), REGARDLESS OF THE NUMBER OF CLAIMS.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">17. Dispute Resolution&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Except as otherwise provided herein, all disputes and claims relating to or arising out of the Terms of Service for your use of the Apitap Platform and any other claims or causes of action relating to the performance or advertising of the Apitap Services or the Terms of Service, shall be settled by binding arbitration in the county of Los Angles, California. All disputes as to arbitrability or the interpretation or enforceability of this arbitration clause shall be for the court to resolve in accordance with the Federal Arbitration Act. In addition, instead of arbitration, either party may file an individual action in small claims court.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The arbitration shall be administered by the American Arbitration Association (\"AAA\") in accordance with its Commercial Arbitration Rules and Supplementary Procedures for Consumer-Related Disputes&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You and we agree that each may bring claims against the other only in an individual capacity. Such claims may seek relief only for the claimant and not any other customer. Neither you nor we may bring claims as a plaintiff or class member in any purported class, representative or private attorney general proceeding. Unless you and we agree otherwise, the arbitrator may not consolidate more than one person\'s claims and may not award declaratory or injunctive relief that would affect other customers or that is not essential to provide relief for your or our individual claim. If any provision of this paragraph is found to be unenforceable, then the entirety of this arbitration provision shall be null and void.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">18. Termination&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Terms of Service will remain in full force and effect until terminated by either you or Apitap. If you wish to terminate, you may do so by closing your Apitap Account by contacting the customer service department by logging in at www.nomorecards.com.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We reserve the right at any time to modify or discontinue, temporarily or permanently, the Apitap Services with or without notice. You agree that we shall not be liable to you or to any third party for any modification, suspension, or discontinuance of the Apitap Services.&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">19. Miscellaneous Provisions&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Terms and Conditions of this Consumer Service Agreement contains the entire agreement between you and Apitap pertaining to your use of the Apitap Platform, and expressly exclude any writings, representations, agreements or understandings not specifically captured or contained herein, whether written or oral. The Terms of Service are governed by the U.S. Federal Arbitration Act, applicable U.S. federal law, and the laws of the U.S. state or territory in which you are domiciled, without regard to the conflicts of laws rules of that state or territory. If any part of the Terms of Service is held to be invalid under the law of a particular U.S. state or territory, that provision will not apply in that U.S. state or territory, and its invalidity will not affect the validity of the balance of the Terms of Service, which shall remain valid and enforceable according to their terms. The failure to enforce any of the Terms of Service on one occasion shall not prevent enforcement on any other occasion or the enforcement of any other term. Headings and captions shall not be considered included for purposes of interpretation or application hereof, but are for convenience only. You may not assign the Terms of Service without our prior written consent.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">20. Privacy and Your Personal Information&nbsp;</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Please read our privacy policy at www.Apitap.com/privacy. Our Privacy Policy explains how we use and safeguard your data when you use the Apitap Services. You agree to our use of your data in accordance with our Privacy Policy.</span></font></div><div style=\"font-weight: normal; font-size: 10pt; text-align: left; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal;\"><br/></div></div>','<h1 class=\"label\" style=\"text-align: center;\"><font face=\"Arial, Verdana\" style=\"\" size=\"4\">RETURNED - MERCHANDISE AND REFUND POLICY</font></h1><h1 class=\"label\" style=\"text-align: left;\"><font face=\"Arial, Verdana\" size=\"3\" style=\"font-weight: normal;\">Please note: The following return and refund policies may have additional terms, details, or conditions which may apply. Please review the individual Merchant’s Terms and Conditions under their Store Info section for additional details and conditions concerning payment and refund policies, as applicable.</font></h1><h1 class=\"label\" style=\"text-align: left;\"><span style=\"font-weight: normal; font-family: Arial, Verdana;\"><font size=\"3\">Any and all merchandise returned to an Apitap merchant must be; in it\'s original packaging, cannot be damaged, must have all originally included accessories, and everything must be in like new condition and working order.</font></span></h1>','<div style=\"text-align: center;\"><div style=\"text-align: center;\"><font face=\"Arial, Verdana\" size=\"4\"><b style=\"\">Please take a moment to review our Privacy Policy.</b></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><strong><br/></strong></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">This Privacy Policy describes the way Apitap uses and protects the information we collect about Customers and Users. This Privacy Policy does not cover information that you provide to third parties directly. We encourage you to review the privacy policies of any third party to whom you provide information to understand what information will be collected, and how it will be used or disclosed to others.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">This Privacy Policy applies to the Apitap Platform. When we refer to Apitap Platform in this Privacy Policy we mean: (i) the Apitap application (app) installed on your mobile device; (ii) your Apitap User account; (iii) the Apitap web management tools available to you at our website, www.apitap.com and (iv) other related features and services provided by Apitap or its affiliates.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">As used in this Privacy Policy:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">User is an individual or business who activates the Apitap Platform and a User is also anyone who visits the Website.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Personal Information is information that directly identifies or reasonably can be used to identify an individual User. Personal Information does not include Anonymous or Aggregated Information.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Anonymous Information means information that does not directly identify and cannot reasonably be used to identify an individual User.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Aggregated Information means information about groups or categories of Users that does not directly identify and cannot reasonably be used to identify an individual User. Aggregated Information is a kind of Anonymous Information.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Locations Services are electronic services used by mobile and web-based devices or applications that are used to determine a user’s current locations. This may take the form of activating and reading a mobile device’s GPS (Global Positioning System) data or by retrieving the information as provided by an (ISP) internet service provider.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Payment Cards are credit, debit and prepaid cards and other types of payment products.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Participating Issuer is a financial institution that issues Payment Cards and is participating in the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Participating Merchant is a merchant that is enabled to participate in the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You will be able to view our Privacy Policy at any time through the “About Apitap” sections of our mobile app and website. In addition, if you establish an Apitap Account, we will also send a link to the Privacy Policy to the email address you provided us when you established your Apitap Account.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"> </span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">The Apitap Platform</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Apitap has developed a mobile payment, promotional, and commerce platform that utilizes smartphone, contactless, Bluetooth, and near-field communication (NFC) technology, among others, to enable you to use the Apitap Platform to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Complete purchase transactions using prepaid, credit, debit or other payment products; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Receive certain offers, coupons and loyalty cards from participating retailers, food establishments, manufacturers, brands and other marketers</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Become involved in social networks developed around shopping and entertainment</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Experience traditional “in person” retail benefits including, but not limited to, in-store promotions and specials, advertising, sales assistance and on-site ordering.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Personal Information Collected When You Use the Apitap Platform</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We collect Personal Information in a variety of ways, including:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>• You provide it to us when you:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• activate your Apitap account,</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• use the Apitap Platform, or</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">		</span>• interact with Customer care;</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• We collect data when you visit our websites and use our mobile application to provide you with a better and more customized user experience.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• We also obtain data from other sources (third parties), in connection with the operation of the Apitap Platform.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"white-space:pre\">	</span>We collect the following types of information, including Personal Information:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you establish an Apitap Account, we collect the information you provide; including but not limited to your name, email address, Apitap password and contact phone number.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Once you have established your Apitap Account, we collect information we may receive from your mobile device, if used with Apitap, such as your device type and your mobile device ID number. These are used to identify you on our system properly.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to load a Payment Card offered by a Participating Issuer, we collect the type and brand of Payment Card used (for example, type may include credit, debit or prepaid, and brand may include MasterCard, Visa, American Express, Discover), the Payment Card issuer (for example, the Participating Issuer issuing the Payment Card), and Payment Card account numbers, billing address, and expiration dates.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When a Payment Card is used, we collect the fact that a particular Payment Card was used, the location it was used at, the time and date of the transaction, and the identity of the Participating Merchant where the Payment Card was used.<span style=\"white-space:pre\">	</span></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">For other prepaid cards, in addition to the above information, we may also collect the card balance; and other data shared by the issuer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may receive information about the status of your Payment Card (for example, whether it is suspended or cancelled) from your Payment Card issuer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to \"Follow\" a Participating Merchant, we collect which merchant you \"Follow\" in order to provide you with offers and notifications from that Participating Merchant.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you choose to add a Participating Merchant loyalty card, we collect information such as the Participating Merchant and the loyalty card number; by adding a loyalty card to your Apitap Wallet you are choosing to \"Follow\" that Participating Merchant.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you choose to provide your zip code or allow the use of location services, we collect that information in order to better provide you with local or targeted offers for your geographic area.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We also keep track of information about which offers you\'ve selected and used (for example, if you use an offer, we note the fact that the offer was presented by you to the Participating Merchant); and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you use a Payment Card or a loyalty card in connection with an offer that you present, we will collect the fact that a particular Payment Card or loyalty card was used in connection with that particular offer.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you call Customer Care or login to the Website for customer care, we may collect information, including Personal Information, as follows:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you may provide to us for the administration, maintenance and use of your Apitap Account and the Apitap Platform. This information may include a new email address, new password, Security Questions and Answers or any other information you provide.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">At no time will a Apitap representative ever ask you for your account password or mobile access pin code.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information on whether your Apitap account was suspended or terminated; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information about your interaction with the Apitap Platform that may help us protect you from fraud and other misconduct or address the issue you contacted us about.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">When you visit our Website, we may collect information, including Personal Information, as follows:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you provide, such as your name, mailing address, email address, phone number(s) and unique identifiers (such as your user login and password);</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information you provide if you apply for a job, such as your resume and other employment-related information; and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Information about your use of our Website</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Commonly available browser-based information including, but not limited to, type of browser and basic system data and device location (using location services) as provided by the browser.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may use what are referred to as “cookies”, which are browser-oriented pieces of code, to allow us to recognize users in order to provide faster and better service and features during subsequent visits.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may collect this information either when you provide it directly or through the use of:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Cookies or similar technologies to identify the computer or device, and to improve the quality of Apitap Services.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Web-beacons (small graphic images on a Web page or an HTML e-mail that are generally invisible); and</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Software to collect data about your interactions with the Website, such as the time of your visit and whether you have visited the Website before.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">You can manage cookies by using features and functions available on most Internet browsers. For example, most browsers will allow you to choose what cookies can be placed on your computer and to delete or disable cookies. You can find instructions for managing cookie controls on websites for particular browsers. Please note that disabling cookies may prevent you from using specific features on our Website.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If we combine or link cookie or web beacon information with Personal Information, we will treat the combined or linked information as Personal Information under this Privacy Policy.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may advertise our products and services on third party websites. The use of cookies, Web-beacons or similar technologies by such third parties is subject to their privacy policies - not this&nbsp; Privacy Policy.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Use of Your Personal Information</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We use the information we collect, including Personal Information, in a variety of ways. For example, we may use some or all of the information, including Personal Information, we collect to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Provide Apitap Services, including account specific customized functionality</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Notify you about Apitap Service announcements, software updates, changes to the Terms of Service or the Privacy Policy, service alerts or other communication messages in connection with your Apitap Platform user account and usage.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Develop, maintain and improve Apitap Services, and to perform data analysis and research for those purposes.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Investigate, prevent, or take action regarding violations of the Terms of Service or the terms and conditions on our Website or other acceptable use policies provided to you from time to time.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Help ensure security and quality control, and for troubleshooting purposes.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Comply with legal or regulatory requirements.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Respond to regulatory authorities and auditors.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Respond to a subpoena, court order or to establish our legal rights and defend against legal claims or other legal obligations.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Protect against or prevent fraud/identity theft or other illegal activities.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Manage risk and operability issues</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Otherwise operate our business as permitted by law.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We may also use Aggregated Information and Anonymous Information for various purposes such as to perform data analysis and research for the purpose of developing, maintaining and improving Apitap Services; to evaluate the helpfulness of Apitap messaging; to assess the effectiveness of offers provided by Apitap on behalf of Participating Merchants and other third parties; and to market and advertise Apitap products and services.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">If you submit a job application or resume or send a request via the Website, we use Personal Information to communicate with you and, subject to applicable law, to make current hiring decisions, to make future hiring decisions (applicant information is retained for purposes of future job openings unless an applicant indicates otherwise) and to comply with legal obligations, including regarding hiring and workforce diversity.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Sharing of Personal Information with Third Parties</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We share information we collect, including Personal Information, with third parties who assist us in providing services and performing the activities described under the \"Use of your Personal Information\" heading above. Whenever we share with third parties who perform services for us or on our behalf, we require them to agree to maintain appropriate safeguards designed to protect the security and the confidentiality of the Personal Information that we provide to them. We also limit their use of the Personal Information to performing the services requested and limit the circumstances in which they may share the Personal Information with others.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">We also may share your information, including Personal Information, with certain third parties (such as government agencies) as necessary to:</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Comply with legal or regulatory requirements.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Respond to a subpoena, court order or to establish our legal rights and defend against legal claims or other legal obligations.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Protect against or prevent fraud/identity theft or other illegal activities.</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Manage risk</span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br/></span></font></div><div style=\"text-align: left;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">• Otherwise operate our business as permitted by law.</span></font></div><div style=\"text-align: left; font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><br/></div></div><div style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><font face=\"Arial, Verdana\"></font></div>',0,1,0,NULL,4933,NULL,4075,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(4937,'Gabby','Pollock','Gabbypollock7@gmail.com',10,'100',33,'','07218b1fbd00431b3a91a38e764e82a0',NULL,NULL,'2022-07-08 18:34:57',NULL,NULL,NULL,'1234',NULL,NULL,NULL,'001','','',51,0,'2022-07-08 18:34:57','2022-07-09 01:38:41',1,NULL,NULL,NULL,NULL,NULL,1,NULL,4701,NULL,'en','1998-07-26',1,0,NULL,NULL,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(4973,'Ashley','Baltagi','Ashleybutler11@gmail.com',10,'100',33,'','963a22763290877a16624187fa16f015',NULL,NULL,'2022-07-15 11:08:44',NULL,NULL,NULL,'1234',NULL,NULL,NULL,'001','','',51,0,'2022-07-15 11:08:44','2022-07-18 13:55:39',1,NULL,NULL,NULL,NULL,NULL,1,NULL,4701,NULL,'en','1987-08-31',1,0,NULL,NULL,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(4980,'Otoniel','Guerrero','laurai1217@hotmail.com',10,'100',33,'','8d038262fdf579bef4bf27850892a6ba',NULL,NULL,'2022-07-27 14:53:47',NULL,NULL,NULL,'81dc9bdb52d04dc20036dbd8313ed055',NULL,NULL,NULL,'001','','',51,0,'2022-07-27 14:53:47','2022-07-28 06:11:29',1,NULL,NULL,NULL,NULL,NULL,1,NULL,4701,NULL,'en','1975-07-29',1,0,NULL,NULL,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(5000,'Chandler','Shirley','chandlermshirley@gmail.com',10,'100',33,'','91d86145f0801e45af463b5f82fe0562',NULL,NULL,'2022-08-23 12:35:25',NULL,NULL,NULL,'1234',NULL,NULL,NULL,'001','','',51,0,'2022-08-23 12:35:25','2022-08-23 23:12:56',1,NULL,NULL,NULL,NULL,NULL,1,NULL,4701,NULL,'en','1992-04-20',1,0,NULL,NULL,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(5024,'Otoniel','Guerrero','otoniel.guerrero99@gmail.com',20,'2C0',33,'Bar Azul','8d038262fdf579bef4bf27850892a6ba',61316,3,'2022-10-28 14:11:24',NULL,3182,NULL,'81dc9bdb52d04dc20036dbd8313ed055',NULL,NULL,'0542518861','001','Mr',NULL,51,0,'2022-10-28 14:10:16','2022-10-28 21:10:16',1,NULL,NULL,NULL,NULL,'Test Description',0,NULL,4701,NULL,'en',NULL,1,0,'<p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\" align=\"CENTER\">\r\n<font size=\"2\"><b><font color=\"#000000\"><font face=\"Arial, serif\">TERMS\r\nAND CONDITIONS OF MERCHANT AGREEMENT</font></font></b></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/>These\r\nTerms and Conditions (as may be revised from time to time by ATL,llc\r\nupon written notice to Merchant) apply to ATLA, LLC.’s provision,\r\nand Merchant’s use, of the Services under this Agreement.<br/><br/></font></font><font face=\"Arial, serif\">ARTICLE\r\n1: TERM AND TERMINATION</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">1.01\r\nTerm.</font><font color=\"#000000\"><font face=\"Arial, serif\">&nbsp;The\r\nterm of this Agreement begins on the Effective Date and will continue\r\nfor twelve (12) consecutive months or as long as services remain in\r\neffect (Term), subject to earlier termination in accordance with this\r\nArticle 1.<br/><br/></font></font><font face=\"Arial, serif\">1.03\r\nTermination by Merchant.</font><font color=\"#000000\"><font face=\"Arial, serif\">&nbsp;Without\r\nincurring liability, Merchant may terminate upon prior 30 day written\r\nnotice (and failure to cure, if applicable) set out in parentheses\r\nafter each ground for termination:&nbsp;</font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font face=\"Arial, serif\">&nbsp;the\r\napplicable Service(s), if ATLA, LLC. violates any of the material\r\nprovisions of this Agreement (30 days notice); (b) if ATLA, LLC.\r\nbecomes bankrupt or insolvent (no notice required); (c) if ATLA, LLC.\r\nincreases its pricing, in aggregate, for the Services, by more than\r\n30% in any 12 month period (30 days\" notice).<br/><br/></font></font></font><br/>\r\n</p>\r\n<p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n<font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><u>ARTICLE\r\n2: PAYMENT</u></font></font></font></p>\r\n<p style=\"margin-bottom: 0in\"><font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">2.01\r\nBilling and Payment</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)\r\nService Fees.</font><font color=\"#000000\"><font face=\"Arial, serif\">&nbsp;ATLA,\r\nLLC. will invoice Merchant for the “Service” each calendar month\r\nbeginning with the effective date of this agreement. The Service Fee\r\nis based on schedule A<br/></font></font><font face=\"Arial, serif\">(b)\r\nDue Date. </font><font color=\"#000000\"><font face=\"Arial, serif\">All\r\ninvoiced amounts, whether for Services or any other charges referred\r\nto in Section 2.01(a), are due as per terms outlined on the purchase\r\norder and invoice (“Due Date). For those Merchants who have\r\nprovided credit card authorization or ACH for payment of invoices,\r\ntheir credit cards or accounts shall be charged on the Due Date.<br/></font></font><font face=\"Arial, serif\">(c)\r\nInterest and Late Fee. </font><font color=\"#000000\"><font face=\"Arial, serif\">If\r\nany undisputed amount is not paid by the Due Date, interest will be\r\ncharged accruing back to the date of invoice for such undisputed\r\namount at the rate of 1.5% per month (18% per annum), or such other\r\nrate as ATLA, LLC. may reasonably set from time to time. A Late Fee\r\nof $25 per month may also be assessed. If, after 5 business days, we\r\ndo not receive your payment, your Service may be interrupted or\r\ncanceled. You may have to pay a fee to reactivate Service if it is\r\ninterrupted for non-payment or suspended for any reason.<br/></font></font><font face=\"Arial, serif\">(d)\r\nTaxes. </font><font color=\"#000000\"><font face=\"Arial, serif\">Unless\r\notherwise expressly agreed in writing by the parties in an Order\r\nForm, Merchant shall pay all customs, duties, and all sales, excise,\r\nlicense, occupation and other taxes of any kind whatsoever, including\r\nregulatory and other like charges that may be imposed by third\r\nparties, which may become payable to any authority by reason of ATLA,\r\nLLC.’s provision of the Services.<br/></font></font><font face=\"Arial, serif\">(e)\r\nAccount Responsibility. </font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nis responsible for all charges applicable to its account, including\r\nbut not limited to all usage-based charges, irrespective of whether\r\nsuch arise as a result of fraud, non-payment on the part of permitted\r\nusers, pursuant to this Agreement, or for any other reason except as\r\nexpressly provided herein.<br/></font></font><font face=\"Arial, serif\">(f)\r\nConsumer Chargebacks.&nbsp;</font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nshall use all reasonable methods to resolve disputes with your\r\ncustomers. Should a chargeback dispute occur, you shall promptly\r\ncomply with all requests for information from ATLA, LLC. You shall\r\nnot attempt to recharge a customer for an item that has been charged\r\nback, unless the customer has authorized such actions.<br/></font></font><font face=\"Arial, serif\">(g)\r\nRefund Policy must be clearly visible. </font><font color=\"#000000\"><font face=\"Arial, serif\">If\r\nMerchant limits refund/exchange terms or other specific conditions\r\nfor sales, your policy must be clearly provided to your customers\r\nprior to the sale, as part of the sale confirmation process. Proper\r\ndisclosure would include wording that is prominently displayed and\r\nstates NO REFUND, EXCHANGE ONLY or something substantially similar\r\nand includes any special terms. NOTE: Qualifying your refund or\r\nexchange terms does not completely eliminate your liability for a\r\nrefund because consumer protection laws and Association rules\r\nfrequently allow the cardholder to still dispute these items. You\r\nagree to display you consumer privacy policy on your website as well\r\nas the security method used for transmission of payment data.\r\nMerchant is responsible for the security of its authorization codes,\r\npasswords, and similar means of access to its equipment, accounts,\r\nand telecommunications systems<br/></font></font><font face=\"Arial, serif\">(h)\r\nCurrency.&nbsp;</font><font color=\"#000000\"><font face=\"Arial, serif\">Payments\r\nto ATLA, LLC. shall be made in the lawful currency of the United\r\nStates of America and all amounts referred to in this Agreement are\r\nin the lawful currency of USA unless otherwise stated.<br/></font></font><font face=\"Arial, serif\">(i)\r\nRate Changes.&nbsp;</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. shall have the right to change any rates for Services upon\r\nthirty (30) days prior written notice to Customer. Such changes will\r\nbe provided in writing to the address and name shown in this\r\nAgreement, and be deemed as a modification to this Agreement. Should\r\nthe change in monthly rates exceed, in aggregate for Services\r\nprovided, 30% of the then-existing fees in any 12 month period, then\r\nthe Merchant shall have the right to terminate this Agreement upon\r\nthirty (30) days written notice to ATLA, LLC. without incurring\r\npenalties.<br/></font></font><font face=\"Arial, serif\">(j)\r\nCollections.&nbsp;</font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nshall be liable to ATLA, LLC. for all costs and/or expenses incurred\r\ndirectly or indirectly, including legal fees, in the collection or\r\nattempted collection of any unpaid charges. In addition, ATLA, LLC.\r\nwill charge Merchant for any bank charges associated with NSF checks\r\nor unauthorized chargebacks.<br/><br/></font></font><font face=\"Arial, serif\">2.02\r\nDisputed Amounts.&nbsp;</font><font color=\"#000000\"><font face=\"Arial, serif\">In\r\nthe event Merchant disputes any charges, Merchant shall notify ATLA,\r\nLLC. in writing of any amounts in dispute before the Due Date.\r\nMerchant is required to remit all undisputed amounts, whether or not\r\ncontained on the same invoice as the disputed amounts, by the Due\r\nDate, or risk incurring late fees, or service suspension and\r\nre-instatement charges. Failure to notify ATLA, LLC. of any disputed\r\namounts before the Due Date shall be deemed to be Merchant\"s\r\nacceptance of the invoiced amounts. ATLA, LLC. shall promptly review\r\nany amounts in dispute and notify Merchant in writing within ten (10)\r\ndays of the receipt of the Merchant’s notice of the results of any\r\nATLA, LLC. review. For any disputed amount agreed to by ATLA, LLC.,\r\nATLA, LLC. shall provide a credit to the Merchant for this amount\r\nand/or may apply such credit against amounts otherwise owing by\r\nMerchant. In the event ATLA, LLC. does not agree with the disputed\r\namounts claimed by Merchant, the following dispute process shall be\r\nemployed: (a) Each party shall appoint a representative and shall\r\nadvise the other party of the name and relevant contact information\r\nfor such representative. The representative of Merchant shall be\r\nresponsible for coordinating an initial meeting of all\r\nrepresentatives, via conference call or otherwise, to discuss the\r\nalleged dispute and to determine a course of resolution; and (b) If\r\nthe representatives have not agreed to a written resolution of the\r\ndispute within thirty (30) days of the initial meeting under\r\nparagraph (a) then the parties may agree to extend this resolution\r\nperiod for an additional period of time. However, at any point after\r\nthe initial 30-day period, if a party determines (acting reasonably)\r\nthat a timely resolution will not occur, such party shall be entitled\r\nto terminate this dispute resolution process upon written notice to\r\nthe other party. If the Merchant remains in default for invoiced\r\namounts, after ATLA, LLC. has provided appropriate proof of usage of\r\nservices through billing records then ATLA, LLC. shall have the right\r\nto suspend or terminate Service<br/><br/></font></font><font face=\"Arial, serif\"><u>ARTICLE\r\n3: OBLIGATIONS OF THE PARTIES</u></font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">3.01\r\nObligations of ATLA, LLC. </font><font color=\"#000000\"><font face=\"Arial, serif\">&nbsp;ATLA,\r\nLLC. agrees to:<br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font face=\"Arial, serif\">Use\r\nall commercially reasonable efforts to provide Services when and\r\nwhere applicable.<br/></font></font><font face=\"Arial, serif\">(b)</font><font color=\"#000000\"><font face=\"Arial, serif\">Comply\r\nwith all applicable laws and regulations respecting the provision of\r\nsuch Services.<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">Provide\r\nthe Customer with Service Support as described in the Service Level\r\nAgreement (SLA) Form.<br/></font></font><font face=\"Arial, serif\">(d)</font><font color=\"#000000\"><font face=\"Arial, serif\">Warrant\r\nthat all such Services as delivered comply with any and all\r\nunderlying agreements with its Underlying Third Party Partners when\r\nused in compliance with the terms and conditions specified in this\r\nAgreement.<br/><br/></font></font><font face=\"Arial, serif\">3.02\r\nObligations of Merchant. Merchant agrees to:</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font f