ingement. Without limiting the generality of the\r\nforegoing, ATLA, LLC. makes no representations, warranties, covenants\r\nor guarantees relating to: (i) network transmission capacity; (ii)\r\nwhether data will be received in an uncorrupted format; (iii) the\r\nsecurity of any transaction, communication, facility or service; (iv)\r\nthe fault tolerance of the Services or the suitability of same for\r\nhigh risk activities; or (v) the compatibility of the services or the\r\nfacilities (including SIMs/Devices and associated firmware and\r\nsoftware) with Merchant\"s use, including Customer’s content,\r\ndata, programs or transmissions. Any applicable warranty relating to\r\nthe foregoing shall be that of the manufacturer or supplier of such\r\nitems.<br/></font></font><font face=\"Arial, serif\">(b)</font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nis responsible for ensuring that access to third party Services and\r\nNetwork within the applicable jurisdiction is in compliance with\r\napplicable laws and ATLA, LLC. makes no representations or warranties\r\nwith respect thereto. ATLA, LLC. reserves the right, in its sole\r\ndiscretion and without any obligation, to make improvements to, or\r\ncorrect any error or omissions in any portion of the Network, which\r\nmay or may not affect Merchant and Subscriber access to the\r\nNetwork.<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. makes no representations concerning any endeavor to review any\r\nof the sites accessed through, and ATLA, LLC. shall not be\r\nresponsible for the accuracy, copyright compliance, legality or\r\ndecency of materials contained in sites accessed through the\r\nNetwork.<br/><br/></font></font><font face=\"Arial, serif\">4.02\r\nLimitation of Liability</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font fac