n and without any obligation, to make improvements to, or\r\ncorrect any error or omissions in any portion of the Network, which\r\nmay or may not affect Merchant and Subscriber access to the\r\nNetwork.<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. makes no representations concerning any endeavor to review any\r\nof the sites accessed through, and ATLA, LLC. shall not be\r\nresponsible for the accuracy, copyright compliance, legality or\r\ndecency of materials contained in sites accessed through the\r\nNetwork.<br/><br/></font></font><font face=\"Arial, serif\">4.02\r\nLimitation of Liability</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. shall have no liability to Merchant, or Subscriber or any other\r\nthird party, for any indirect, incidental, special, or consequential\r\ndamages whatsoever, whether arising in negligence, tort, statute,\r\nequity, contract, common law or any other cause of action or legal\r\ntheory, including, but not limited to, loss of revenue or profit,\r\nloss or damage to data, loss of business, failure to realize expected\r\nsavings, loss of downtime or any other commercial or economic loss of\r\nany kind whatsoever, arising out of or in connection with this\r\nAgreement or the provision of the Services, even if ATLA, LLC. has\r\nbeen advised of the possibility of such damages, or if they are\r\nforeseeable. You acknowledge and agree that we, (ATLA, LLC.), (i)\r\nhave no responsibility or liability for or under any of your\r\nagreements with any third parties whether or not identified or\r\nreferenced in the terms of service, and (ii) cannot and will not be\r\nliable for any acts, omissions materials, products, or services of\r\nany of them or any other third party including, without limitation,\r\n(iii) any mistake in authenticating data, for security purposes or\r\notherwise, (iv) verifying whether you are eligible to complete the\r\ntransaction or make the payment for which you are accessing the ATLA,\r\nLLC. platform, (v) any mistake by a participating merchant,\r\nparticipating issuer, wireless service provider, payment processor or\r\notherwise in connection with your completing a transaction or making\r\na payment, (vi) any mistake in transmission of data by any third\r\nparty, (vii) any failure in equipment, transmission systems or the\r\nfailure of the internet to transmit information, (viii) any failure\r\nof your ATLA, LLC.-enabled mobile device or any equipment necessary\r\nto enable the ATLA, LLC. services, (ix) any failure of a\r\nparticipating merchant or participating issuer to authorize a\r\ntransaction you initiated by means of the ATLA, LLC. platform, or (x)\r\nany failure of a participating merchant to honor or otherwise engage\r\nin a commerce activity or abide by any commerce activity contract.\r\nThe ATLA, LLC. services are provided on an ‘as is\' and ‘as\r\navailable\' basis, and the terms of service may contain other\r\ndisclaimers, limitations and exclusions that may not be allowed in\r\ncertain jurisdictions, and thus not applicable to you.<br/></font></font><font face=\"Arial, serif\">(b)</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. shall not be liable to Merchant for any damages arising out of\r\nor relating to: (i) facilities, equipment, software, applications,\r\nservices or content provided by the Merchant, Subscribers or third\r\nparties, (ii) service interruptions, degradation, errors, delays or\r\ndefects of transmission, (iii) unauthorized access to or theft,\r\nalteration or loss or destruction of the Merchant, Subscriber’s, or\r\nthird party’s applications, content, data, programs, information,\r\nnetwork or systems by any means, or (iv) any act or omission of the\r\nMerchant, Subscribers or third parties<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">THIS\r\nSERVICE IS PROVIDED \"AS IS\" AND WE MAKE NO WARRANTY OF ANY\r\nKIND, EXPRESS OR IMPLIED, INCLUDING ANY IMPLIED WARRANTY OF\r\nMERCHANTABILITY OR FITNESS FOR A PARTICULAR PURPOSE, IN CONNECTION\r\nWITH THE SERVICES PROVIDED TO YOU UNDER THIS AGREEMENT. WE DO NOT AND\r\nCANNOT WARRANT THAT THE SERVICE WILL OPERATE WITHOUT ERRORS OR THAT\r\nTHE SERVICE WILL BE AVAILABLE AND OPERATIONAL AT ALL TIMES. WE ARE\r\nNOT RESPONSIBLE FOR THE QUALITY, SAFETY, LEGALITY, OR ANY OTHER\r\nASPECT OF ANY GOODS OR SERVICES YOU PURCHASE THROUGH THE USE OF THIS\r\nSERVICE.<br/></font></font><font face=\"Arial, serif\">(d)</font><font color=\"#000000\"><font face=\"Arial, serif\">You\r\nacknowledge and agree if we do not complete a transaction, or\r\ncomplete a transaction incorrectly, we will be liable for your\r\nindividual losses or damages up to the value of the transaction.\r\nHowever, there are some exceptions. To the extent allowed by law, we\r\nwill not be liable for consequential damages (including lost\r\nprofits), extraordinary damages, special or punitive damages. We will\r\nnot be liable, for instance: (i) If, through no fault of ours, you do\r\nnot have enough money in your account to make the transfer or\r\ncomplete a transaction; (ii) If an electronic terminal or online\r\npoint of purchase (e-commerce system) where you are making a\r\ntransaction does not operate properly; (iii) If access to your\r\naccount has been blocked or suspended; (iv) If there is a hold or the\r\nfunds in your account are subject to legal process or other\r\nencumbrance restricting their use; (v) If we have reason to believe\r\nthe requested transaction is unauthorized or fraudulent; (vi) If\r\ncircumstances beyond our control (such as fire, flood or computer or\r\ncommunication failure) prevent the completion of the transaction,\r\ndespite reasonable precautions that we have taken.<br/><br/></font></font><font face=\"Arial, serif\">4.03\r\nMerchant Acknowledgment. </font><font color=\"#000000\"><font face=\"Arial, serif\">Merchant\r\nacknowledges that the limited warranty, the exclusive remedies and\r\nlimited liability set out herein are fair and reasonable in the\r\ncommercial circumstances of this Agreement.<br/><br/></font></font><font face=\"Arial, serif\"><u>ARTICLE\r\n5: CONFIDENTIALITY AND OWNERSHIP</u></font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">(a)</font><font color=\"#000000\"><font face=\"Arial, serif\"> Each\r\nparty agrees to keep confidential any and all information with\r\nrespect to the other party which has received or may in the future\r\nreceive in connection with this Agreement, which shall include\r\nwithout limitation, the terms and conditions of this Agreement and,\r\nwith regard to ATLA, LLC. Confidential Information includes any\r\ninformation with regard to the Services which ATLA, LLC. provides to\r\nMerchant (the “Confidential Information”) and shall only disclose\r\nsuch information (i) to its agents, employees or representatives who\r\nhave a need to know such information, for the purpose of performance\r\nunder this Agreement and exercising the rights granted under this\r\nAgreement and who have executed a nondisclosure agreement at least as\r\nprotective of the disclosing party\"s Confidential Information as\r\nthis Agreement, or (ii) to the extent required by applicable law or\r\nduring the course of or in connection with any litigation,\r\narbitration or other proceeding based upon or in connection with the\r\nsubject matter of this Agreement, provided that the receiving party\r\nshall give the disclosing party reasonable notice prior to such\r\ndisclosure and shall comply with any applicable protective order or\r\nequivalent.<br/></font></font><font face=\"Arial, serif\">(b)</font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. and any other suppliers or licensors of ATLA, LLC. shall own and\r\nretain all right, title and interest in and to all products,\r\nmaterials or services, including without limitation, all Confidential\r\nInformation, provided under this Agreement or in connection with this\r\nAgreement. Customer gains no right, title or interest with respect\r\nthereto except for the limited rights to use as expressly granted\r\nherein. All rights not expressly granted herein are hereby\r\nreserved.<br/></font></font><font face=\"Arial, serif\">(c)</font><font color=\"#000000\"><font face=\"Arial, serif\">Each\r\nof the parties will be able to disclose the existence of this\r\nagreement and relationship between the Merchant and ATLA, LLC.\r\npursuant to one or more public announcements or disclosures. A\r\nlimited, non-exclusive, royalty-free license to use the other party’s\r\nname and logo shall be granted in connection therewith. All such\r\nitems shall be previously approved in writing by both\r\nparties.<br/><br/></font></font><font face=\"Arial, serif\"><u>ARTICLE 6:\r\nDISPUTE RESOLUTION PROCESS</u></font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">The\r\nParties agree that any dispute, controversy, or claim arising out of\r\nor relating to this Agreement, (except for an amount billed by ATLA,\r\nLLC. to the Merchant which shall be settled according to the terms\r\ndescribed in Section 2.02), failing settlement as outlined above,\r\nshall be settled by arbitration. To decide the dispute, the\r\narbitrator shall apply the federal laws of the United States and the\r\nstate laws of the state of California. The parties covenant that they\r\nwill share equally in the costs for the arbitration proceedings;\r\nhowever, the arbitrator shall have the authority to award the\r\nprevailing party recovery of all costs, fees and expenses, including\r\nattorneys\" fees to be paid by the party against whom enforcement\r\nis ordered. The decision of the arbitrator shall be binding upon the\r\nparties, and judgment on the award may be entered in any court of\r\ncompetent jurisdiction. Pending final disposition of any dispute\r\nunder this Agreement the parties agree to proceed diligently and in\r\ngood faith with the performance of this Agreement, including without\r\nlimitation, the dispute resolution process described above, and to\r\ncomply with all terms and conditions herein.</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\"><u>ARTICLE\r\n7: GENERAL PROVISIONS</u></font><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/></font></font><font face=\"Arial, serif\">7.01\r\nEntire Agreement, Including Amendments. </font><font color=\"#000000\"><font face=\"Arial, serif\">This\r\nAgreement, Schedules, and Attachments, set out the entire agreement\r\nbetween the parties concerning the matters described above and\r\nsupersede all prior written or oral agreements, or understandings.\r\nATLA, LLC. expressly reserves its right to amend Schedules and\r\nAttachments upon 30 days prior notice to Customer. Except as provided\r\nfor herein, this Agreement may only be amended by consent in writing\r\nof both parties. To the extent of any conflict or inconsistency\r\nbetween the provisions in the body of this Agreement and any\r\nschedule, attachment, exhibit or addendum hereto, the terms of such\r\nschedule, attachment, exhibit, or addendum hereto shall prevail.<br/></font></font><font face=\"Arial, serif\">7.02\r\nAssignment.</font><font color=\"#000000\"><font face=\"Arial, serif\">\r\nMerchant shall not assign its rights and obligations under this\r\nAgreement without the prior written consent of ATLA, LLC., such\r\nconsent for which will not be unreasonably withheld.<br/></font></font><font face=\"Arial, serif\">7.03\r\nNon-exclusivity.</font><font color=\"#000000\"><font face=\"Arial, serif\">\r\nNothing in this Agreement shall limit either party from pursuing\r\nalternative supplier and supply relationships.<br/></font></font><font face=\"Arial, serif\">7.04\r\nWaiver.</font><font color=\"#000000\"><font face=\"Arial, serif\"> A\r\nfailure by either party to enforce any right under this Agreement\r\nshall not at any time constitute a waiver of such right or any other\r\nright and shall not modify the rights or obligations of either party\r\nunder this Agreement. If any provision of this Agreement is declared\r\nby a court of competent jurisdiction to be invalid, illegal, or\r\nunenforceable, such a provision shall be deemed severed from the\r\nAgreement and the other provisions shall remain in full force and\r\neffect.<br/></font></font><font face=\"Arial, serif\">7.05 Force\r\nMajeure.</font><font color=\"#000000\"><font face=\"Arial, serif\"> Other\r\nthan for obligations of payment arising hereunder, neither party will\r\nbe liable for delays in its performance hereunder due to causes\r\nbeyond its reasonable control, including but not limited to, acts of\r\nGod, public enemy, government, regulatory authorities, or courts of\r\nlaw or equity, or caused by civil war, insurrection or riots, fires,\r\nfloods, explosions, earthquakes or other casualties, strikes or other\r\nlabor troubles, or failure of third party service providers or\r\ntelecommunications networks or devices, provided that the party so\r\nrelieved of its obligations hereunder provides notice to the other\r\nparty and takes all reasonable and necessary steps to resume\r\nperformance of its obligations as soon as possible.<br/></font></font><font face=\"Arial, serif\">7.06\r\nNotice. </font><font color=\"#000000\"><font face=\"Arial, serif\">Any\r\nnotice to a party required or permitted hereunder shall be\r\nsufficiently given only when provided in writing, and either\r\npersonally delivered to a responsible officer of the addressee or\r\nsent via certified or registered mail (return receipt required) or\r\nfacsimile (with proof of transmission) to the party\'s address\r\nindicated herein. The addresses and designated individuals are as set\r\nforth below or as otherwise notified to the other Party from time to\r\ntime<br/></font></font><font face=\"Arial, serif\">7.07 Change. </font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. shall have the right to change at any time the design or\r\nspecifications of any part its platform during the terms of this\r\nagreement.<br/></font></font><font face=\"Arial, serif\">7.07 Applicable\r\nLaws.</font><font color=\"#000000\"><font face=\"Arial, serif\"> The\r\nvalidity, construction, interpretation and legal effect of this\r\nAgreement will be governed by the laws of the State of California,\r\nwithout reference to its conflict of law provisions. This Agreement\r\nis deemed accepted, executed and performed in California. The\r\nServices and Network shall be deemed solely based in California; and\r\n(ii) the Services shall be deemed passive that do not give rise to\r\npersonal jurisdiction over ATLA, LLC., either specific or general, in\r\njurisdictions other than California. Any claims relating to or\r\narising out of or under this Agreement shall be subject to the\r\nexclusive jurisdiction of the federal and state courts located in Los\r\nAngeles, California. Customer and ATLA, LLC. waive all objections to\r\nsuch jurisdiction and venue. ATLA, LLC. makes no representation that\r\nthe Services are appropriate or available for use in all locations.\r\nCustomer agrees to comply with any laws that apply to Customer’s\r\naccess and use of the Services and Network, including laws particular\r\nto your locality, state or country.<br/></font></font><font face=\"Arial, serif\">7.08\r\nSurvival.</font><font color=\"#000000\"><font face=\"Arial, serif\"> The\r\nfollowing Articles and Sections will survive termination or\r\nexpiration of this Agreement for any reason for a period of twelve\r\n(12) months: Section 1.04 and Articles 2, 4, 5 and 6<br/></font></font><font face=\"Arial, serif\">7.09\r\nSub-Contracting. </font><font color=\"#000000\"><font face=\"Arial, serif\">ATLA,\r\nLLC. reserves the right to sub-contract any part of a Service,\r\nprovided such third party agreements are bound by the terms of this\r\nAgreement and ATLA, LLC. retains responsibility for any such\r\nsubcontracted Services.<br/><br/></font></font></font><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in\" align=\"CENTER\"><font size=\"2\"><font face=\"Arial, serif\">MERCHANT\r\nSERVICES TERMS AND CONDITIONS</font><font color=\"#000000\"><font face=\"Arial, serif\"><br/></font></font></font><br/>\r\n</p>\r\n','\r\n<p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\" align=\"CENTER\">\r\n<font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><b>RETURNED\r\n- MERCHANDISE AND REFUND POLICY</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in\"><font size=\"2\"><font color=\"#000000\"><font face=\"Arial, serif\"><br/><br/>Please\r\nnote: The following return and refund policies may have additional\r\nterms, details, or conditions which may apply. Please review our full\r\nMerchant Use Terms and Conditions for additional details and\r\nconditions concerning payment and refund policies, as\r\napplicable.<br/><br/>Any and all merchandise returned to ATLA, LLC must\r\nbe; in it\'s original packaging, cannot be damaged, must have all\r\noriginally included accessories, and everything must be in like new\r\ncondition and working order.<br/><br/>If the merchandise fails any of\r\nthese conditions, without prior approval from ATLA, LLC, then it will\r\nbe returned to the merchant at the merchant\'s expense and no refund\r\nwill be issued. If the return is accepted, then the merchandise will\r\nbe subject to a 20% restocking fee.<br/><br/>Each service subscription\r\n(location or online) a merchant has must be cancelled individually.\r\nThe first 30 days (month) of subscription service is subject to a 30\r\nday money back guarantee, in the event the merchant wishes to cancel\r\ntheir service during that first 30 days. After that, merchants have\r\nuntil seven (7) days before their renewal date to cancel a\r\nsubscription for the following month. If we do not have a\r\ncancellation notice by then, then the subscription will automatically\r\nrenew and payment processed five (5) days before the renewal date. No\r\nrefunds will be issued for subscriptions not canceled within the time\r\nlimit.<br/></font></font></font><br/>\r\n</p>\r\n','<p style=\"margin-bottom: 0in; line-height: 100%\" align=\"CENTER\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Your\r\nprivacy is important to us. Please take a moment to review our\r\nPrivacy Policy.</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">This\r\nPrivacy Policy describes the way Apitap uses and protects the\r\ninformation we collect about Customers and Users. This Privacy Policy\r\ndoes not cover information that you provide to third parties\r\ndirectly. We encourage you to review the privacy policies of any\r\nthird party to whom you provide information to understand what\r\ninformation will be collected, and how it will be used or disclosed\r\nto others.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">This\r\nPrivacy Policy applies to the Apitap Platform. When we refer\r\nto</font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b> Apitap\r\nPlatform</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> in\r\nthis Privacy Policy we mean: (i) the Apitap application (app)\r\ninstalled on your mobile device; (ii) your Apitap User account; (iii)\r\nthe Apitap web management tools available to you at our website,\r\nwww.Apitap.com and (iv) other related features and services provided\r\nby Apitap or its affiliates.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">As\r\nused in this Privacy Policy:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><strong>User </strong></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">is\r\nan individual or business who activates the Apitap Platform and a\r\nUser is also anyone who visits the Website.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Personal\r\nInformation </b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">is\r\ninformation that directly identifies or reasonably can be used to\r\nidentify an individual User. Personal Information does not include\r\nAnonymous or Aggregated Information.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Anonymous\r\nInformation</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> means\r\ninformation that does not directly identify and cannot reasonably be\r\nused to identify an individual User.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Aggregated\r\nInformation</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> means\r\ninformation about groups or categories of Users that does not\r\ndirectly identify and cannot reasonably be used to identify an\r\nindividual User. Aggregated Information is a kind of Anonymous\r\nInformation.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Locations\r\nServices </b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">are\r\nelectronic services used by mobile and web-based devices or\r\napplications that are used to determine a user’s current locations.\r\nThis may take the form of activating and reading a mobile device’s\r\nGPS (Global Positioning System) data or by retrieving the information\r\nas provided by an (ISP) internet service provider.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Payment\r\nCards</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> are\r\ncredit, debit and prepaid cards and other types of payment products.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Participating\r\nIssuer</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> is\r\na financial institution that issues Payment Cards and is\r\nparticipating in the Apitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Participating\r\nMerchant</b></font></font></font><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"> is\r\na merchant that is enabled to participate in the Apitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">You\r\nwill be able to view our Privacy Policy at any time through the\r\n“About Apitap” sections of our mobile app and website. In\r\naddition, if you establish an Apitap Account, we will also send a\r\nlink to the Privacy Policy to the email address you provided us when\r\nyou established your Apitap Account.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"> </font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>The\r\nApitap Platform</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Apitap\r\nhas developed a mobile payment, promotional, and commerce platform\r\nthat utilizes smartphone, contactless, Bluetooth, and near-field\r\ncommunication (NFC) technology, among others, to enable you to use\r\nthe Apitap Platform to:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Complete purchase transactions\r\nusing prepaid, credit, debit or other payment products; and</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Receive certain offers,\r\ncoupons and loyalty cards from participating retailers, food\r\nestablishments, manufacturers, brands and other marketers</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Become involved in social\r\nnetworks developed around shopping and entertainment</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Experience traditional “in\r\nperson” retail benefits including, but not limited to, in-store\r\npromotions and specials, advertising, sales assistance and on-site\r\nordering.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Personal\r\nInformation Collected When You Use the Apitap Platform</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\ncollect Personal Information in a variety of ways, including:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">	•\r\nYou provide it to us when you:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\nactivate your Apitap account,</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\nuse the Apitap Platform, or</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">		•\r\ninteract with Customer care;</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">We collect data when you visit\r\nour websites and use our mobile application to provide you with a\r\nbetter and more customized user experience.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">We also obtain data from other\r\nsources (third parties), in connection with the operation of the\r\nApitap Platform.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">	We\r\ncollect the following types of information, including Personal\r\nInformation:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you establish an Apitap Account, we collect the information you\r\n	provide; including but not limited to your name, email address,\r\n	Apitap password and contact phone number.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Once\r\n	you have established your Apitap Account, we collect information we\r\n	may receive from your mobile device, if used with Apitap, such as\r\n	your device type and your mobile device ID number. These are used to\r\n	identify you on our system properly.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to load a Payment Card offered by a Participating Issuer,\r\n	we collect the type and brand of Payment Card used (for example,\r\n	type may include credit, debit or prepaid, and brand may include\r\n	MasterCard, Visa, American Express, Discover), the Payment Card\r\n	issuer (for example, the Participating Issuer issuing the Payment\r\n	Card), and Payment Card account numbers, billing address, and\r\n	expiration dates.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When a\r\n	Payment Card is used, we collect the fact that a particular Payment\r\n	Card was used, the location it was used at, the time and date of the\r\n	transaction, and the identity of the Participating Merchant where\r\n	the Payment Card was used.	</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">For\r\n	other prepaid cards, in addition to the above information, we may\r\n	also collect the card balance; and other data shared by the issuer.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We may\r\n	receive information about the status of your Payment Card (for\r\n	example, whether it is suspended or cancelled) from your Payment\r\n	Card issuer.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to \"Follow\" a Participating Merchant, we\r\n	collect which merchant you \"Follow\" in order to provide\r\n	you with offers and notifications from that Participating Merchant.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If you\r\n	choose to add a Participating Merchant loyalty card, we collect\r\n	information such as the Participating Merchant and the loyalty card\r\n	number; by adding a loyalty card to your Apitap Wallet you are\r\n	choosing to \"Follow\" that Participating Merchant.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\n	you choose to provide your zip code or allow the use of location\r\n	services, we collect that information in order to better provide you\r\n	with local or targeted offers for your geographic area.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We also\r\n	keep track of information about which offers you\'ve selected and\r\n	used (for example, if you use an offer, we note the fact that the\r\n	offer was presented by you to the Participating Merchant); and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If you\r\n	use a Payment Card or a loyalty card in connection with an offer\r\n	that you present, we will collect the fact that a particular Payment\r\n	Card or loyalty card was used in connection with that particular\r\n	offer.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\nyou call Customer Care or login to the Website for customer care, we\r\nmay collect information, including Personal Information, as follows:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you may provide to us for the administration, maintenance and use of\r\n	your Apitap Account and the Apitap Platform. This information may\r\n	include a new email address, new password, Security Questions and\r\n	Answers or any other information you provide.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">At no\r\n	time will a Apitap representative ever ask you for your account\r\n	password or mobile access pin code.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	on whether your Apitap account was suspended or terminated; and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	about your interaction with the Apitap Platform that may help us\r\n	protect you from fraud and other misconduct or address the issue you\r\n	contacted us about.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">When\r\nyou visit our Website, we may collect information, including Personal\r\nInformation, as follows:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you provide, such as your name, mailing address, email address,\r\n	phone number(s) and unique identifiers (such as your user login and\r\n	password);</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	you provide if you apply for a job, such as your resume and other\r\n	employment-related information; and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Information\r\n	about your use of our Website</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Commonly\r\n	available browser-based information including, but not limited to,\r\n	type of browser and basic system data and device location (using\r\n	location services) as provided by the browser.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We may\r\n	use what are referred to as “cookies”, which are\r\n	browser-oriented pieces of code, to allow us to recognize users in\r\n	order to provide faster and better service and features during\r\n	subsequent visits.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nmay collect this information either when you provide it directly or\r\nthrough the use of:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Cookies\r\n	or similar technologies to identify the computer or device, and to\r\n	improve the quality of Apitap Services.</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Web-beacons\r\n	(small graphic images on a Web page or an HTML e-mail that are\r\n	generally invisible); and</font></font></font></p>\r\n</li></ul>\r\n<ul><li><p style=\"margin-top: 0.07in; margin-bottom: 0.07in; line-height: 100%\">\r\n	<font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">Software\r\n	to collect data about your interactions with the Website, such as\r\n	the time of your visit and whether you have visited the Website\r\n	before.</font></font></font></p>\r\n</li></ul>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">You\r\ncan manage cookies by using features and functions available on most\r\nInternet browsers. For example, most browsers will allow you to\r\nchoose what cookies can be placed on your computer and to delete or\r\ndisable cookies. You can find instructions for managing cookie\r\ncontrols on websites for particular browsers. Please note that\r\ndisabling cookies may prevent you from using specific features on our\r\nWebsite.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If\r\nwe combine or link cookie or web beacon information with Personal\r\nInformation, we will treat the combined or linked information as\r\nPersonal Information under this Privacy Policy.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nmay advertise our products and services on third party websites. The\r\nuse of cookies, Web-beacons or similar technologies by such third\r\nparties is subject to their privacy policies - not this  Privacy\r\nPolicy.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Use\r\nof Your Personal Information</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nuse the information we collect, including Personal Information, in a\r\nvariety of ways. For example, we may use some or all of the\r\ninformation, including Personal Information, we collect to:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Provide Apitap Services,\r\nincluding account specific customized functionality</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Notify you about Apitap\r\nService announcements, software updates, changes to the Terms of\r\nService or the Privacy Policy, service alerts or other communication\r\nmessages in connection with your Apitap Platform user account and\r\nusage.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Develop, maintain and improve\r\nApitap Services, and to perform data analysis and research for those\r\npurposes.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Investigate, prevent, or take\r\naction regarding violations of the Terms of Service or the terms and\r\nconditions on our Website or other acceptable use policies provided\r\nto you from time to time.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Help ensure security and\r\nquality control, and for troubleshooting purposes.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Comply with legal or\r\nregulatory requirements.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Respond to regulatory\r\nauthorities and auditors.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Respond to a subpoena, court\r\norder or to establish our legal rights and defend against legal\r\nclaims or other legal obligations.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Protect against or prevent\r\nfraud/identity theft or other illegal activities.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Manage risk and operability\r\nissues</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Otherwise operate our business\r\nas permitted by law.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nmay also use Aggregated Information and Anonymous Information for\r\nvarious purposes such as to perform data analysis and research for\r\nthe purpose of developing, maintaining and improving Apitap Services;\r\nto evaluate the helpfulness of Apitap messaging; to assess the\r\neffectiveness of offers provided by Apitap on behalf of Participating\r\nMerchants and other third parties; and to market and advertise Apitap\r\nproducts and services.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">If\r\nyou submit a job application or resume or send a request via the\r\nWebsite, we use Personal Information to communicate with you and,\r\nsubject to applicable law, to make current hiring decisions, to make\r\nfuture hiring decisions (applicant information is retained for\r\npurposes of future job openings unless an applicant indicates\r\notherwise) and to comply with legal obligations, including regarding\r\nhiring and workforce diversity.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\"><b>Sharing\r\nof Personal Information with Third Parties</b></font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nshare information we collect, including Personal Information, with\r\nthird parties who assist us in providing services and performing the\r\nactivities described under the \"Use of your Personal\r\nInformation\" heading above. Whenever we share with third parties\r\nwho perform services for us or on our behalf, we require them to\r\nagree to maintain appropriate safeguards designed to protect the\r\nsecurity and the confidentiality of the Personal Information that we\r\nprovide to them. We also limit their use of the Personal Information\r\nto performing the services requested and limit the circumstances in\r\nwhich they may share the Personal Information with others.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\"><font face=\"Arial, serif\"><font size=\"2\">We\r\nalso may share your information, including Personal Information, with\r\ncertain third parties (such as government agencies) as necessary to:</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Comply with legal or\r\nregulatory requirements.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Respond to a subpoena, court\r\norder or to establish our legal rights and defend against legal\r\nclaims or other legal obligations.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Protect against or prevent\r\nfraud/identity theft or other illegal activities.</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Manage risk</font></font></font></p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><br/>\r\n</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%\"><font color=\"#000000\">•\r\n<font face=\"Arial, serif\"><font size=\"2\">Otherwise operate our business\r\nas permitted by law.</font></font></font></p>\r\n',0,0,0,NULL,5027,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(5040,'Brittany','Shook','brittanyshook81@gmail.com',10,'100',33,'','062bac28bcd936f694d2c49fd9fd90a8',NULL,NULL,'2022-11-26 13:51:06',NULL,NULL,NULL,'1234',NULL,NULL,NULL,'001','','',51,0,'2022-11-26 13:51:06','2022-11-26 21:51:06',1,NULL,NULL,NULL,NULL,NULL,1,NULL,4701,NULL,'en','2022-11-25',1,0,NULL,NULL,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,'DefaultPROFILE_image.jpg'),(5042,'Laura','Zelman','staronlm@gmail.com',10,'100',33,'','834be94c4